(64784, 'ruRU', '9.0 Rated PvP Incentive - Shadowlands Season 2 Exclusive Mount', '', '', '', '', '', '', '', '', 39653),
(64651, 'ruRU', 'Дух кобры', 'Отнесите дух кобры леди Муун в Сердце леса.', '<Дух кобры ненасытен и воинственен. Теперь вы можете обращаться в кобру.>', '', '', '', '', '', 'Отнесите дух кобры леди Муун в Сердце леса.', 39653),
(64650, 'ruRU', 'Дух гиены', 'Отнесите дух гиены леди Муун в Сердце леса.', '<Дух гиены неистов и стремителен. Теперь вы можете обращаться в гиену.>', '', '', '', '', '', 'Отнесите дух гиены леди Муун в Сердце леса.', 39653),
(64640, 'ruRU', 'AubriesTestQuestForJeff', '', '', '', '', '', '', '', '', 39653),
(64607, 'ruRU', 'Тазавеш: кабальная сделка', 'Найдите делового партнера Ау\'манала и предложите ему свою помощь.', 'О, тебе это очень идет. Ты – само воплощение легитимности!\n\nМоя часть сделки выполнена, теперь ты $gдолжен:должна; помочь мне. Найди моего делового партнера Фе\'таджида в Золотой гавани и помоги ему.\n\nБуду ждать новостей о твоем успехе.', '', '', '', '', '', '', 39653),
(64599, 'ruRU', 'Святилище Господства – Проклятие на твою голову', 'Соберите четыре осколка филактерии Кел\'Тузада в Святилище Господства в эпохальном режиме.', 'Я чувствую присутствие Кел\'Тузада в этих стенах. Собери осколки его филактерии, и я открою путь в его зал.\n\nЧетырех будет достаточно. Мы же не хотим, чтобы он опять вернулся?', '', '', '', '', '', '', 39653),
(64598, 'ruRU', 'Святилище Господства – Проклятие на твою голову', 'Соберите четыре осколка филактерии Кел\'Тузада в Святилище Господства в героическом режиме.', 'Я чувствую присутствие Кел\'Тузада в этих стенах. Собери осколки его филактерии, и я открою путь в его зал.\n\nЧетырех будет достаточно. Мы же не хотим, чтобы он опять вернулся?', '', '', '', '', '', '', 39653),
(64597, 'ruRU', 'Святилище Господства – Проклятие на твою голову', 'Соберите четыре осколка филактерии Кел\'Тузада в Святилище Господства в обычном режиме.', 'Я чувствую присутствие Кел\'Тузада в этих стенах. Собери осколки его филактерии, и я открою путь в его зал.\n\nЧетырех будет достаточно. Мы же не хотим, чтобы он опять вернулся?', '', '', '', '', '', '', 39653),
(64571, 'ruRU', 'Тазавеш: найти и не уничтожить', '', '', '', '', '', '', '', '', 39653),
(64567, 'ruRU', 'Пропавший ученый', 'Найдите ученого Ро-Сюира в Кортии.', 'А, пилигрим! Твое возвращение внушает надежду. Ты бы $gзнал:знала;, как нам нужна твоя помощь!\n\nНесколько ученых пропали без следа. В последний раз их видели за работой в большом зале. Мы боимся, что они больше не вернутся к нам. Хуже того – что их забрали те, кто разрушил нашу мирную жизнь.\n\nНайди какие-нибудь зацепки и возвращайся ко мне.\n\nДа будет путь твой ясен.', '', '', '', '', '', '', 39653),
(64562, 'ruRU', 'Нам нужен лекарь, то есть ты!', 'Исцелите $1oa |4раненого союзника:раненых союзников:раненых союзников; из армии ковенантов на Форуме Искателей.', 'На поле боя слишком много раненых! \n\nИсцеление – это не просто \"тяп-ляп и все здоровы\". Нам нужно больше способных лекарей.\n\nВот, возьми мое устройство и подними раненых на ноги!', '', '', '', '', '', '', 39653),
(64561, 'ruRU', 'Записи наблюдений', 'Соберите $1oa |4запись:записи:записей; наблюдений на Обветренном утесе и в эстуарии Пробуждения в Кортии.', 'Приветствую тебя, пилигрим Утробы. Не уделишь мне минутку?\n\nКак ты, наверное, уже знаешь, мой картель тайно разместил по всей Кортии наблюдательные устройства. Но мы не можем проанализировать данные, пока не соберем их. Я попрошу это сделать тебя.\n\nПриборы на Обветренном утесе и в эстуарии Пробуждения уже должны были записать достаточно. Ты не увидишь сами устройства, но собранные данные появятся перед тобой в виде яркой сферы.\n\nНе забудь проверить в пещерах под землей!\n\nДобудь эту информацию, и я щедро тебе заплачу.', '', '', '', '', '', '', 39653),
(64560, 'ruRU', 'Изъятие анимы', 'Добудьте $1oa ед. поглощенной анимы у пожирателей в Святилище наставлений.', 'Чтобы продолжать борьбу, нам нужен постоянный приток свежих солдат, припасов и анимы. По понятным причинам последнее найти сложнее всего. Но трудности научили меня изобретательности. \n\nНедалеко отсюда есть обильный источник анимы – пожиратели, которыми кишит Святилище наставников. Конечно, аниму проще извлекать из душ, чем из пожирателей, но результат тот же. Если тебе хватит силы. Попробуешь?', '', '', '', '', '', '', 39653),
(64557, 'ruRU', 'Найдено во тьме', 'Найдите Ве\'ниша в Торгасте, Башне Проклятых.', 'Картель Ве не впервые рыщет по опасным местам ради сокровищ. Будь у них чуть побольше ума, они бы оставили поиск и продажу товара картелю Зи. Но увы.\n\nОдин из членов Ве исчез в Торгасте, и при себе у него была краденая шкатулка с могущественными артефактами. Он полагал, что их сила защитит от ужасов башни. Безумная затея!', '', '', '', '', '', '', 39653),
(64556, 'ruRU', 'Просьба о помощи', 'Выполните 3 ежедневных задания Миканикоса, Та\'наси и Кель\'таса в Кортии.', 'Обитателям Кортии пришлось столько вынести! Если бы мы не подоспели вовремя, войско Тюремщика вихрем пронеслось бы по всему Городу Тайн, оставляя лишь руины на своем пути.\n\nЧтобы продолжить борьбу, нам нужно помочь пострадавшим.\n\nОтветь на зов наших союзников, пилигрим. Пусть ни один прислужник Тюремщика не избежит кары.', '', '', '', '', '', '', 39653),
(64555, 'ruRU', 'Раскрывая секреты', 'Поговорите с разведчиками ковенантов в Кортии.', 'Каждый ковенант послал на задание лучших специалистов. Некоторые из них отправились исследовать эти неизвестные земли.\n\nПоговори с ними и попроси доклад с наблюдениями. А потом принеси их мне.', '', '', '', '', '', '', 39653),
(64554, 'ruRU', 'Атака вентиров', 'Завершите $1oa |4задание:задания:заданий; в цитадели Вечных Мук и Лике Забвения.', 'Нам удалось застать силы Тюремщика врасплох. Мы захватим цитадель Вечных Мук и разделаемся с ее защитниками у Алтаря Господства!\n\nНам очень нужна твоя помощь, пилигрим Утробы. Помоги нашим войскам в бою!', '', '', '', '', '', '', 39653),
(64553, 'ruRU', 'Легенда о Колодце анимы', 'Отнесите \"Легенду о Колодце анимы\" тактику Сакаа в Грехопад.', '<Вы нашли разрозненные заметки некого архивариуса о поисках таинственного источника анимы, скрытого в глубинах Кортии.\n\nТактик Сакаа в Грехопаде соберет для вас отряд, чтобы найти его.>', '', '', '', '', '', 'Отнесите \"Легенду о Колодце анимы\" тактику Сакаа в Грехопад.', 39653),
(64552, 'ruRU', 'Легенда о Колодце анимы', 'Отнесите \"Легенду о Колодце анимы\" Коросу в Элизийскую цитадель.', '<Вы нашли разрозненные заметки некого архивариуса о поисках таинственного источника анимы, скрытого в глубинах Кортии.\n\nКорос в Элизийской цитадели соберет для вас отряд, чтобы найти его.>', '', '', '', '', '', 'Отнесите \"Легенду о Колодце анимы\" Коросу в Элизийскую цитадель.', 39653),
(64551, 'ruRU', 'Легенда о Колодце анимы', 'Отнесите \"Легенду о Колодце анимы\" Мерику Боевому Шраму в Престол Примаса.', '<Вы нашли неполные заметки некого архивариуса о поисках таинственного источника анимы, скрытого в глубинах Кортии.\n\nМерик Боевой Шрам в Престоле Примаса соберет для вас отряд, чтобы найти его.>', '', '', '', '', '', 'Отнесите \"Легенду о Колодце анимы\" Мерику Боевому Шраму в Престол Примаса.', 39653),
(64549, 'ruRU', 'Легенда о Колодце анимы', 'Отнесите \"Легенду о Колодце анимы\" дозорной Вечерний Цветок в Сердце леса.', '<Вы нашли неполные заметки некого архивариуса о поисках таинственного источника анимы, скрытого в глубинах Кортии.\n\nДозорная Вечерний Цветок в Сердце леса соберет для вас отряд, чтобы найти его.>', '', '', '', '', '', 'Отнесите \"Легенду о Колодце анимы\" дозорной Вечерний Цветок в Сердце леса.', 39653),
(64541, 'ruRU', 'Цена смерти', '', '', '', '', '', '', '', '', 39653),
(64532, 'ruRU', 'Последние реликвии', 'Изучите, какие реликвии пропали из Реликвария воспоминаний и купите отчет об исследованиях, посвященный древним святилищам.', 'У меня прекрасные новости, $n. Я определил последние пропавшие реликвии! \n\nПридется потрудиться, чтобы их найти, но результаты моих исследований тебе помогут.\n\nПрошу, осмотри последние из наших пропавших реликвий. Уже совсем скоро мы вернем их все!', '', '', '', '', '', '', 39653),
(64531, 'ruRU', 'Мор\'гет', '', '', '', '', '', '', '', '', 39653),
(64530, 'ruRU', 'Кристалл танатокрыла', 'Отнесите кристалл танатокрыла Камнетворице в Приют хранителя.', '<Этот крупный кусок кристалла откололся от огромного существа. В нем потрескивают всполохи энергии.\n\nКамнетворица в Приюте хранителя сможет вдохнуть жизнь в танатокрыла с помощью этого кристалла.>', '', '', '', '', '', 'Отнесите кристалл танатокрыла Камнетворице в Приют хранителя.', 39653),
(64529, 'ruRU', 'Невредимый сердечник аквилона', 'Отнесите невредимый сердечник аквилона Деосу в Приют хранителя.', '<Огромный мертвый пожиратель сжимает в кулаке вырванный сердечник одного из аквилонов, чьи останки валяются вокруг. На вид сердечник почти невредим.\n\nДеос в Приюте хранителя покажет, в какого аквилона его можно вставить.>', '', '', '', '', '', 'Отнесите невредимый сердечник аквилона Деосу в Приют хранителя.', 39653),
(64528, 'ruRU', 'Седло чащобника', 'Отнесите седло чащобника Релдорну в Приют хранителя.', '<Сбежавший чащобник стряхнул к вашим ногам седло, когда вы слезли с его спины. Он неохотно позволил пикси увести себя обратно в Приют хранителя.\n\nРелдорн в Приюте хранителя может объяснить, что он хотел этим сказать.>', '', '', '', '', '', 'Отнесите седло чащобника Релдорну в Приют хранителя.', 39653),
(64527, 'ruRU', 'Наблюдение за погоней', 'Включите режим войны и убейте $1oa |4игрока:игроков:игроков; в открытом мире.', 'Наблюдая за конфликтами вашего народа, мы заметили, что очень большому проценту жертв удается сбежать.\n\nОт этого страдают результаты наших наблюдений.\n\nНаблюдатель хочет снабдить тебя инструментом, который поможет принудить противника к столкновению.\n\nНо сначала мы просим тебя доказать готовность участвовать в таких конфликтах, чтобы подтвердить твою надежность как потенциального партнера.', '', '', '', '', '', '', 39653),
(64526, 'ruRU', 'Таинственные Разломы', 'Изучите, какие реликвии пропали из Реликвария воспоминаний, и купите у Ро-Сюира восстановленный ключ Разлома.', 'Огромное спасибо за помощь, $n. Я обнаружил в кодексе другие неповрежденные реликвии.\n\nОни сохранились в странных Разломах Кортии.\n\nЕсли у меня получится открыть в них проход, ты сможешь войти внутрь и найти больше пропавших реликвий.\n\nЯ выставил для тебя образцы, как обычно. Как следует изучи их, прежде чем отправляться на поиски.', '', '', '', '', '', '', 39653),
(64522, 'ruRU', 'Украденные кортийские припасы', 'Отнесите украденные кортийские припасы герцогине Минкс в Приют хранителя.', '<На этих припасах стоит клеймо Легиона Смерти. Кто-то незаметно украл их из Разлома.\n\nГерцогиня Минкс в Приюте хранителя будет очень благодарна, если вы их вернете.>', '', '', '', '', '', 'Отнесите украденные кортийские припасы герцогине Минкс в Приют хранителя.', 39653),
(64521, 'ruRU', 'Военные планы Верных Хелии', 'Отнесите военные планы Верных Хелии герцогине Минкс в Приют хранителя.', '<В военных планах подробно описаны вероятные пути наступления на Кортию, а также оборонительные позиции Легиона Смерти.\n\nГерцогиня Минкс в Приюте хранителя сможет быстро передать эту информацию кому нужно.>', '', '', '', '', '', 'Отнесите военные планы Верных Хелии герцогине Минкс в Приют хранителя.', 39653),
(64519, 'ruRU', 'Утраченные хранилища', 'Изучите, какие реликвии пропали из Реликвария воспоминаний.', 'Я изучил записи о других реликвиях, которые еще можно отыскать в Кортии. Думаю, они сохранились в наших малых хранилищах.\n\nЕсли ты мне поможешь, я заново изготовлю открывающие их устройства.\n\nЯ расставил копии пропавших реликвий. Осмотри их и запомни, что искать.', '', '', '', '', '', '', 39653),
(64513, 'ruRU', 'Голова Ве\'райн', 'Отнесите голову Ве\'райн Ве\'нари в ее убежище.', '<Ве\'райн уже довольно давно охотится за Ве\'нари. Изгнанница будет рада увидеть доказательство того, что Ве\'райн ее больше не побеспокоит.>', '', '', '', '', '', 'Отнесите голову Ве\'райн Ве\'нари в ее убежище.', 39653),
(64511, 'ruRU', 'Пропавшие реликвии', 'Изучите, какие реликвии пропали из Реликвария воспоминаний.', 'Благодаря твоей помощи мне удалось восстановить еще больше записей о пропавших реликвиях хранилища.\n\nВ кодексе нашлись упоминания о других реликвиях, которые еще можно отыскать.\n\nОни запечатаны в сундуках, но во время первого нападения их разбросало по всей Кортии.\n\nЯ подготовил место для пропавших реликвий вон там. Пусть они отпечатаются у тебя в памяти. Их нужно вернуть.', '', '', '', '', '', '', 39653),
(64509, 'ruRU', 'Стильный убор', '', '', '', '', '', '', '', '', 39653),
(64508, 'ruRU', '[DNT] Conduit Energy', '', '', '', '', '', '', '', '', 39653),
(64506, 'ruRU', 'Все, что нужно найти', 'Изучите, какие реликвии пропали из Реликвария воспоминаний.', 'Кодекс описывает множество реликвий. Одни утрачены навсегда, другие еще можно отыскать.\n\nНекоторые могущественные реликвии еще могли сохраниться в целости в одном из тайников в Кортии. \n\nОтправляйся в реликварий. Там ты увидишь артефакты, которые пока еще невредимы.\n\nЗапомни их как следует. Ты $gдолжен:должна; найти их и вернуть мне.', '', '', '', '', '', '', 39653),
