(64441, 'ruRU', 'Последние приготовления', 'Возьмите книгу и верните ее владельцам.', '<Видимо, кто-то в лагере вентиров нечаянно смахнул эту книгу со стола.\n\nЛучше вернуть книгу, пока громиты не набили ее страницами гнездо. Вентиры наверняка поблагодарят вас за находку.>', '', '', '', '', '', '', 39653),
(64438, 'ruRU', 'Усиление снаряжения', 'Поговорите с младшим ученым Ка-Везом, чтобы улучшить предмет снаряжения из Кортии.', 'Найденные тобой исследования открывают множество перспектив.\n\nВ том числе возможность улучшать снаряжение из Кортии.\n\nПоговори с моим помощником неподалеку. Он может применить эти знания, чтобы вернуть снаряжению утраченную силу.', '', '', '', '', '', '', 39653),
(64437, 'ruRU', 'Сообщение для Примаса', 'Вернитесь к Примасу в Кортию.', '$n, возвращайся в Кортию и скажи Примасу, что печать Королевы Зимы восстановлена.', '', '', '', '', '', '', 39653),
(64432, 'ruRU', 'От слабости к силе', 'Зарядите грозовой разрядник и убейте Верных Утробе.', '$p, у собранного металлолома очень интересные свойства. Я считаю, Верные Утробе укрепляют свои доспехи какими-то чарами.\n\nВозьми этот грозовой разрядник. Во-первых, тебе надо подставиться под молнию. Нечего так на меня смотреть. Все с тобой будет нормально. Но перед этим встань на металл Верных Утробе. Например, на огромные цепи, опутавшие Кортию возле Обветренного утеса.\n\nКогда... кхм... зарядишься энергией, я пришлю таурала Боррхаса. Он повезет тебя в бой.', '', '', '', '', '', '', 39653),
(64376, 'ruRU', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64368, 'ruRU', 'Эффективное восстановление', '', '', '', '', '', '', '', '', 39653),
(64325, 'ruRU', 'Ветеран Грехопада', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', '$n! Благодаря твоим успехам влияние Грехопада растет.\n\nТвои достижения стали замечать и за пределами Ревендрета.\n\nВести о твоих победах гремят под сводами Орибоса. Эксперт по конфликтам Зо\'сорг просит тебя навестить его в Анклаве.\n\nОн очень интересуется всем, что касается искусства войны. Не заставляй его ждать.', '', '', '', '', '', '', 39653),
(64324, 'ruRU', 'Ветеран некролордов', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', '$n! Благодаря твоим успехам мощь некролордов растет.\n\nТвои достижения стали замечать и за пределами Малдраксуса.\n\nВести о твоих победах гремят под сводами Орибоса. Эксперт по конфликтам Зо\'сорг просит тебя навестить его в Анклаве.\n\nОн очень интересуется всем, что касается искусства войны. Не заставляй его ждать.', '', '', '', '', '', '', 39653),
(64323, 'ruRU', 'Кирийский ветеран', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', '$n! Благодаря твоим успехам наши земли продолжают исцеляться. Путь открыт.\n\nТвои достижения стали замечать и за пределами Бастиона.\n\nВести о твоих победах гремят под сводами Орибоса. Эксперт по конфликтам Зо\'сорг просит тебя навестить его в Анклаве.\n\nОн очень интересуется всем, что касается искусства войны. Не заставляй его ждать.', '', '', '', '', '', '', 39653),
(64322, 'ruRU', 'Ветеран ночного народца', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', 'Благодаря тебе в Арденвельде стало куда спокойнее.\n\nТвои достижения стали замечать и за пределами нашего леса.\n\nВести о твоих победах гремят под сводами Орибоса. Эксперт по конфликтам Зо\'сорг просит тебя навестить его в Анклаве.\n\nОн очень интересуется всем, что касается искусства войны. Не заставляй его ждать.', '', '', '', '', '', '', 39653),
(64314, 'ruRU', 'Возрождение ковенантов', 'Поговорите с Примасом и примите печати ковенантов.', 'Мы бросили все силы на то, чтобы не дать Тюремщику разбить барьер вокруг Утробы и вторгнуться в Темные Земли.\n\nНо вместо этого он раздвинул границы самой Утробы, поглотив Орибос и забрав печать Арбитра.\n\nЯ не до конца понимаю, что произошло у нас на глазах на вершине Торгаста. Зато Примас знает.\n\nПора перейти к крайним мерам. Представители ковенантов скоро принесут свои печати. \n\nСообщи Примасу, что мы готовы начинать.', '', '', '', '', '', '', 39653),
(64306, 'ruRU', 'Критерии для выполнения задания', '', '', '', '', '', '', '', '', 39653),
(64304, 'ruRU', 'Новые возможности ждут', 'Убейте $1oa |4игрока:игроков:игроков; в Кортии.', 'Куда-то торопишься? Ах да! Эй, пилигрим, не желаешь изучить новую загадочную материю, когда в следующий раз отправишься в Утробу?\n\nМне хотелось бы узнать, какие секреты она скрывает.\n\nМожет, здесь мы сумеем помочь друг другу.\n\nЕсли тебя заинтересовало мое предложение, продолжим разговор. Если нет, иди своей дорогой. Я найду другого помощника.', '', '', '', '', '', '', 39653),
(64292, 'ruRU', 'Маэли Странница', 'Возьмите на себя заботу о Маэли.', 'Огромное спасибо, что $gнашел:нашла; Маэли! По-моему, она для меня чуточку слишком активная.\n\nМожет, лучше ты за ней присмотришь? Кажется, ты ей уже нравишься!', '', '', '', '', '', '', 39653),
(64290, 'ruRU', 'Данные для исследования', 'Поговорите с архивариусом Ро-Сюиром, чтобы передать фрагменты реликвий для исследования каталога.', 'Спасибо за эти фрагменты. С ними мы восстановим немалую часть наших архивов. \n\nЯ исследую то, что ты уже $gнашел:нашла;, и попробую что-нибудь узнать о других пропавших реликвиях. \n\nПосле этого все зависит от тебя: ищи в Кортии новые фрагменты и реликвии, чтобы пополнить наши архивы.', '', '', '', '', '', '', 39653),
(64289, 'ruRU', 'Сбор фрагментов', 'Добудьте в Кортии 50 фрагментов реликвий у редких существ и в сундуках с сокровищами.', 'Кортия многого лишилась, когда Тюремщик притянул ее в Утробу.\n\nМногие бесценные реликвии раскололись. Я видел, как звери растаскивают осколки.\n\nИх нужно вернуть.\n\nСразись с воинами Тюремщика и обыщи руины Кортии, чтобы вернуть реликвии в наше некогда великое хранилище.', '', '', '', '', '', '', 39653),
(64288, 'ruRU', 'Идеал Ве\'нари', 'Поговорите с Ве\'нари в ее убежище в Утробе.', 'Идем, пилигрим. Найди меня в моем убежище.\n\nНадо обсудить еще кое-что.\n\nДа, и проверь, чтобы не было слежки.', '', '', '', '', '', '', 39653),
(64287, 'ruRU', 'Идеал Кодекса архивариуса', 'Поговорите с архивариусом Ро-Сюиром в Реликварии воспоминаний в Кортии.', 'Ты не $gостановился:остановилась; ни перед чем, чтобы вернуть самое для нас дорогое, пилигрим.\n\nНайди меня в моих покоях, когда сможешь прийти. Нам нужно обсудить одно последнее дело.', '', '', '', '', '', '', 39653),
(64286, 'ruRU', 'Идеал Легиона Смерти', 'Поговорите с герцогиней Минкс в Приюте Хранителя в Кортии.', 'Ты снова $gоткликнулся:откликнулась; на наш призыв. Твоя помощь не пройдет незамеченной.\n\nПосмотрим, что у нас найдется в награду за труд.', '', '', '', '', '', '', 39653),
(64282, 'ruRU', 'Сплошные сюрпризы', 'Найдите хранилище Зоваала.', 'Ты не перестаешь меня удивлять, пилигрим Утробы. Весьма неожиданно видеть тебя здесь!\n\nРаз мы оказались тут вместе, предлагаю объединиться.\n\nГде-то в этом разломе у Тюремщика есть хранилище, полное сокровищ. Найди его для меня, а еще лучше – принеси сюда. Открыв хранилище, я поделюсь с тобой его богатствами.', '', '', '', '', '', 'Возвращайтесь к Ве\'нари с хранилищем Зоваала или без него.', 39653),
(64274, 'ruRU', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64273, 'ruRU', 'Сдержать Верных Хелии', '', '', '', '', '', '', '', '', 39653),
(64271, 'ruRU', 'Более цивилизованный подход', 'Встретьтесь с Наджией у дороги, ведущей в Кортию.', 'А, $p...\n\nМне нужно с тобой кое-что обсудить. Только не здесь.\n\n<Наджия подозрительно косится на других жителей Приюта хранителя.>\n\nНайди меня на дороге у границы с Кортией, и я все объясню.', '', '', '', '', '', '', 39653),
(64267, 'ruRU', 'Таинственные подарки Ве\'нари', 'Поговорите с Ве\'нари в ее убежище в Утробе.', 'Ты умудряешься раз за разом выживать и при этом приносить мне какую-никакую пользу. Впечатляет, пилигрим. Ты напоминаешь меня, когда я была гораздо моложе и наивнее. \n\nВозьми это – и продолжай в том же духе... только еще осторожнее и незаметнее.', '', '', '', '', '', '', 39653),
(64266, 'ruRU', 'Припасы Кодекса архивариуса', 'Поговорите с архивариусом Ро-Сюиром в Реликварии воспоминаний в Кортии.', 'У меня нет слов, чтобы описать, как меня радует то, что ты с такой решимостью защищаешь наследие Кортии.\n\nПрошу тебя. Прими это в знак моей благодарности.', '', '', '', '', '', '', 39653),
(64255, 'ruRU', 'Вечеринка', '', '', '', '', '', '', '', '', 39653),
(64216, 'ruRU', 'Знания о Башне', 'Отнесите шкатулку многих тайн в Торгаст.', 'Эту шкатулку можно открыть, накормив ее воспоминаниями и гордостью победителя. Такие чары мне знакомы. В других мирах с их помощью истощают и усмиряют души. Обычно в благих целях, но это... чудовище... превратило их в замок.\n\nБросая вызов испытаниям Торгаста, пуская в ход свое мастерство и побеждая, ты будешь получать знания о Башне. Они могут насытить шкатулку. \n\nНакорми ее и извлеки заключенную в ней мощь.', '', '', '', '', '', 'Отнесите шкатулку многих тайн в Торгаст.', 39653),
(64214, 'ruRU', 'Символ надежды', 'Помогите изучить компас Андуина.', 'Прежде чем последовать за Тюремщиком, Андуин что-то уронил на землю.\n\nНе знаю, что это был за предмет, но Джайна подняла его. Может, Андуин все еще сопротивляется Тюремщику!\n\nМы должны выяснить, что юный король уронил и зачем оставил эту зацепку.', '', '', '', '', '', '', 39653),
(64213, 'ruRU', 'Символ надежды', 'Помогите Джайне изучить компас Андуина.', 'Прежде чем последовать за Тюремщиком, Андуин что-то уронил на землю.\n\nВряд ли по приказу Тюремщика. Это знак того, что Андуин пока сохранил свою душу!\n\n<Джайна раскрывает ладонь и показывает золотой компас.>\n\nАндуин очень дорожил им. Я чувствую, что он сохранил в этом компасе часть себя.\n\nМы должны выяснить, зачем он оставил его нам.', '', '', '', '', '', '', 39653),
(64212, 'ruRU', 'Дверь во тьме', 'Поговорите с Траллом и узрите окончание битвы в Торгасте.', 'Боюсь, в борьбе с Зоваалом мы потерпели крах, $gсмертный:смертная;.\n\nВрата в запретное царство открылись... и Изгнанник вернул себе силу, которой его лишили много веков назад.\n\nВижу, твои союзники вернулись из Святилища Господства. Расскажите мне все в мельчайших подробностях.', '', '', '', '', '', '', 39653),
(64211, 'ruRU', 'Дверь во тьме', 'Поговорите с Джайной и станьте свидетелем окончания битвы в Торгасте.', 'Боюсь, в борьбе с Зоваалом мы потерпели крах, $gсмертный:смертная;.\n\nВрата в запретное царство открылись... и Изгнанник вернул себе силу, которой его лишили много веков назад.\n\nВижу, твои союзники вернулись из Святилища Господства. Расскажите мне все в мельчайших подробностях.', '', '', '', '', '', '', 39653),
(64210, 'ruRU', 'Шкатулка многих тайн', 'Отнесите шкатулку многих тайн Резчику Рун.', 'А, это же пилигрим Утробы. Ужасы башни скоро одолеют меня, и я исчезну навеки. Но ты беспрепятственно ходишь по этим залам, не поддаваясь их гнету. \n\nУ меня была надежда, что шкатулка победит тьму Башни. Нельзя было переоценивать свои способности.\n\nНадеюсь, я не переоцениваю твои. Забирай шкатулку. Докажи, что $gдостоин:достойна; ее.', '', '', '', '', '', '', 39653),
(64202, 'ruRU', 'Рука помощи', 'Примите помощь Нилганихмата.', 'Твоя мощь, пилигрим... не уступила бы моей даже до того, как Тюремщик разрубил меня на части.\n\nПеред тобой лишь малая часть меня, но этого достаточно...\n\nПозволь мне помочь тебе в борьбе с Зоваалом. Так свершится моя месть.', '', '', '', '', '', '', 39653),
(64194, 'ruRU', 'Боевой прототип', 'Победите Краксиса на Обветренном утесе с помощью прототипа колосса.', 'Как верховный автоматург, я всегда стремлюсь совершенствовать свои творения!\n\nНо самые крупные центурионы такие огромные, что мы не можем доставить их в Кортию. Надо это исправить. Вот, это \"Атлеос\" – прототип колосса для полевых испытаний. Передовой боец кирийской армии! \n\nЕго надо протестировать. Как можно тщательнее. Лучше всего против сильного врага.\n\nВозьми \"Атлеоса\" и победи большого зверя Утробы! Понажимай на все кнопки!', '', '', '', '', '', '', 39653),
