(64166, 'ruRU', 'Случайное воспоминание', 'Соберите воспоминания кортийцев с помощью эфемерных крыльев.', 'Когда цепи Тюремщика захватили Кортию в Утробу, она превратилась в руины. Он уничтожил не только горы и здания, но и ее народ.\n\nИх жизни, надежды, воспоминания.\n\nЯ убеждаю себя, что они не могли пропасть бесследно. Мы должны попробовать спасти то, что от них осталось.\n\nВот, возьми немного моей силы и постарайся собрать эти воспоминания. Принеси их мне. Со мной они будут в безопасности. \n\nНикто не будет забыт.', '', '', '', '', '', '', 39653),
(64138, 'ruRU', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64131, 'ruRU', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64129, 'ruRU', 'Атака Дикой Охоты', 'Сядьте на Альдерми и убейте Верных Утробе в Кортии.', 'За годы в Дикой Охоте я научилась лучше сражаться и защищать Темные Земли. \n\nИ я продолжаю тренироваться. Но я очень рада, что могу учиться вместе с тобой. И с моим верным оленем Альдерми.\n\nЕго дрессируют, чтобы он тоже бросался в бой как яростный воркай, но ему нужна практика. Прокатись на нем и попробуй растоптать как можно больше Верных Утробе.', '', '', '', '', '', '', 39653),
(64106, 'ruRU', 'Общими усилиями', 'Помогите ковенантам в борьбе против слуг Тюремщика в Утробе.', 'Ты $gзаключил:заключила; крепкий союз как со своим ковенантом, так и с другими царствами Темных Земель. Теперь они помогают нам в борьбе с Зоваалом.\n\nОни готовы поддержать нас, когда мы будем штурмовать Утробу.\n\nКовенанты нанесут Тюремщику удар с разных сторон. Помоги им изгнать прислужников Зоваала из этого кошмарного царства, чтобы положить конец его растущему могуществу.', '', '', '', '', '', '', 39653),
(64103, 'ruRU', 'Проверенный трюк', 'Убейте командиров Верных Утробе Мороса, Ойзиза и Апэйта.', '$p! Мы снова сражаемся плечом к плечу, защищая Темные Земли.\n\nС каждым днем у нас все меньше шансов на победу, но мы еще можем изменить расклад в свою пользу. Я прошу тебя найти нескольких командиров Верных Утробе. В каждой армии есть как хорошие командиры, так и плохие. Если убрать хороших, их место займут бездари, и вся армия ослабеет.\n\nШпионы из дома Глаз узнали конкретные имена. Убей этих командиров.', '', '', '', '', '', '', 39653),
(64101, 'ruRU', 'Соблюдение процедур', 'Принесите $1oa |4украденный сосуд:украденных сосуда:украденных сосудов; с анимой.', 'Моя обязанность – следить за прибывшими из Ревендрета. Но до меня доходят тревожные вести.\n\n$p, смотрители рассказали, что наши же сородичи воруют канистры с запасенной анимой. Мы не можем закрыть на это глаза.\n\nЕсли тебе не трудно, поможешь вернуть эту аниму? Я прослежу, чтобы она попала в надежные руки.', '', '', '', '', '', '', 39653),
(64092, 'ruRU', 'Охота на Хална', 'Наденьте маскировочный костюм и найдите Хална в крепости Господства, избегая встреч со стражей.', 'Халн где-то здесь, но Камнетворица закрыла свои владения с тех пор, как начались, гм, проблемы с повелителями ужаса. Стражники никого не пускают и гонят взашей всех чужих.\n\nНо Халну повезло, мы с Дуборылом придумали безотказный план!\n\nПрикинемся своими, походим там, поспрашиваем и найдем Хална. Легко!', '', '', '', '', '', '', 39653),
(64091, 'ruRU', 'Обман Мал\'ганиса', 'Соберите связующие печати.', '<Натрезим ловит ваш взгляд, собираясь что-то сказать. Вы оглядываетесь на своих спутников. Лунная Ягода с озорной усмешкой подталкивает вас вперед. Вы подходите, насколько хватает смелости.>\n\nВыпусти меня из этой тюрьмы, $gсмертный:смертная;. Ты не пожалеешь об этом. Эти жалкие марионетки и их хозяева – ничто по сравнению с той силой, которой служу я. Они понятия не имеют, что происходит на самом деле. \n\nТы только принеси связующие печати, удерживающие меня здесь. Остальное... оставь мне.\n\nОсвободи меня, и я подарю тебе невообразимую силу.', '', '', '', '', '', '', 39653),
(64090, 'ruRU', 'Выжималка', 'Незаметно пройдите туда, куда по мнению Дуборыла увели Хална.', 'Короче, наша рогатая феечка угодила в выжималку. Скажи спасибо, что у меня уже все схвачено.\n\nПлан такой: спокойненько заходим под видом рабочих, берем твоего лося, в глаза клыкастым не глядим, мышкой шмыгаем наружу. $gВсе понял:Все поняла;?', '', '', '', '', '', '', 39653),
(64086, 'ruRU', 'Кирийский тактик', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', '$n! Оглянись вокруг. Элизийская цитадель стоит как памятник нашим победам, которые мы одержали благодаря тебе.\n\nЗо\'сорг снова хочет видеть тебя в Орибосе. Иди.\n\nБлагосклонность картеля Зо – это то, за что стоит бороться. Заслужить доверие клана брокеров не так-то просто.\n\nПолагаю, у них есть для тебя что-то заманчивое.', '', '', '', '', '', '', 39653),
(64085, 'ruRU', 'Тактик ночного народца', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', 'Благодаря твоей храбрости Арденвельд опять расцветает. А ты еще раз $gпривлек:привлекла; внимание брокеров.\n\nЗо\'сорг снова хочет видеть тебя в Орибосе. Иди.\n\nБлагосклонность картеля Зо – это то, за что стоит бороться. Заслужить доверие клана брокеров не так-то просто.\n\nДумаю, у них есть для тебя что-то заманчивое.', '', '', '', '', '', '', 39653),
(64084, 'ruRU', 'Тактик некролордов', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', 'Ты оказываешь честь некролордам. И эта честь привлекает внимание важных особ.\n\nЗо\'сорг снова хочет видеть тебя в Орибосе. Иди.\n\nБлагосклонность картеля Зо – это то, за что стоит бороться. Заслужить доверие клана брокеров не так-то просто.\n\nПолагаю, у них есть для тебя что-то заманчивое.', '', '', '', '', '', '', 39653),
(64083, 'ruRU', 'Тактик Грехопада', 'Поговорите с Зо\'соргом в Анклаве в Орибосе.', 'Грехопад вновь начинают уважать. Денатрию такое и не снилось! И все это благодаря тебе, $n.\n\nЗо\'сорг снова хочет видеть тебя в Орибосе. Иди.\n\nБлагосклонность картеля Зо – это то, за что стоит бороться. Заслужить доверие клана брокеров не так-то просто.\n\nПолагаю, у них есть для тебя что-то заманчивое.', '', '', '', '', '', '', 39653),
(64080, 'ruRU', 'С небес на землю', 'Сбейте $1oa |4Верного Утробе предвестника:Верных Утробе предвестников:Верных Утробе предвестников; на землю копьем Корейн.', 'Я слышу, как Верные Утробе хлопают крыльями в небе, глумясь над нами. \n\n Но пойманную птицу можно раздавить, просто сжав пальцы. \n\nВозьми мое копье и сбей их на землю, а затем прикончи. \n\nНе забывай про копье. Не надо бегать туда-сюда и ждать, пока они на тебя спикируют. Смысл не в этом.\n\nЯ хочу видеть, как ты сбиваешь их с неба.', '', '', '', '', '', '', 39653),
(64070, 'ruRU', 'Всего понемногу', 'Добудьте $1oa |4кусок:куска:кусков; металлолома у Верных Утробе.', 'Нашей армии всегда требуется новое оружие, доспехи и солдаты. Всегда.\n\nНам присылают подкрепления, но в таких условиях я не успеваю их вооружать. У меня нет ни нормальной кузни, ни помощников.\n\nПридется придумать какую-то замену. Добудь у Верных Утробе любой металл – не важно, в каком состоянии. Я посмотрю, какое оружие из него можно выковать.', '', '', '', '', '', '', 39653),
(64065, 'ruRU', 'Местные реагенты', 'Соберите $1oa |4коготь:когтя:когтей; сланцевика, $2oa |4лапу:лапы:лап; громита и $3oa |4шип:шипа:шипов; бритвокрыла.', 'Кортия – очень странное царство. Все растения и животные здесь совсем другие. Наверное, из-за многолетнего влияния Хранилища и спрятанных в нем реликвий.\n\n$gГотов:Готова; к небольшому эксперименту? Для начала запасемся реагентами.\n\nОколо Форума Искателей обитают сланцевики, громиты и бритвокрылы. Не напорись на их иглы!', '', '', '', '', '', '', 39653),
(64043, 'ruRU', 'Нам нужен лекарь, то есть ты!', 'Исцелите $1oa |4раненого союзника:раненых союзников:раненых союзников; из армии ковенантов на Форуме Искателей.', 'На поле боя слишком много раненых! \n\nИсцеление – это не просто \"тяп-ляп и все здоровы\". Нам нужно больше способных лекарей.\n\nВот, возьми мое устройство и подними раненых на ноги!', '', '', '', '', '', '', 39653),
(64042, 'ruRU', 'Ритуалы ночи', 'Помогите подготовить и провести ритуал.', 'У Тиранды почти не осталось времени. Нужно действовать быстро. \n\n<Изера задумчиво хмурится.>\n\nМы надеялись собрать больше Ночных Воительниц, но придется работать с тем, что имеем, и надеяться, что этого будет достаточно.\n\n<Изера качает головой, затем ее взгляд становится твердым и решительным.>\n\nНо сначала нам нужно завершить подготовку к ритуалу. Собери оставшиеся предметы и возвращайся в рощу.', '', '', '', '', '', '', 39653),
(64018, 'ruRU', 'Тяжесть камня', 'Помогите Каменному легиону доставить припасы и аниму.', 'Наступление продолжается, $p. Каменный легион прибыл, чтобы переломить ход войны.\n\nПервым делом надо доставить припасы нашим союзникам. Кортия лежит в руинах, и только мы можем обеспечить снабжение.\n\nВо-вторых, надо разобраться с Верными Утробе и пожирателями. Предлагаю простую стратегию: мы сбросим на Верных Утробе аниму. Она привлечет голодных пожирателей, и либо они убьют Верных Утробе, либо Верные Утробе убьют их. Мы в выигрыше в любом случае.', '', '', '', '', '', '', 39653),
(64017, 'ruRU', 'Скользим со стилем', 'Протестируйте способности Блупа к размножению на Площадке терзателей.', 'Подмастерье! Я тебя искал.\n\nКевин стал таким прекрасным помощником в наших экспериментах, что я хочу обучить и других слизнюков!\n\nНужно изучить способности Блупа к размножению. Возьми его с собой и поищи где-нибудь медведей. Прикажи Блупу ввести в их организм слизь и посмотри, что получится.', '', '', '', '', '', '', 39653),
(64016, 'ruRU', 'Скользим со стилем', 'Опробуйте, насколько вырастет Склизь, на сланцевиках на Площадке терзателей.', 'Подмастерье! Я тебя искал.\n\nКевин стал таким прекрасным помощником в наших экспериментах, что я хочу обучить и других слизнюков!\n\nНадо попробовать накормить Склизя органикой и посмотреть, насколько он вырастет.', '', '', '', '', '', '', 39653),
(64014, 'ruRU', 'Утроба для начинающих', 'Спросите Ве\'нари в ее убежище, как связать Илскахорн с Утробой.', 'Перед великой битвой осталось еще одно дело. Рог нужно связать с Утробой, чтобы его голос пронзил завесу вокруг этого жуткого царства. \n\nНо как это сделать, я не представляю. Найди того, кто изучил все тайны Утробы. Такой советник наверняка сумеет направить тебя по верному пути.\n\nДаника со своими сестрами будет ждать зова Илскахорна, $n. Они ответят в нужный час.', '', '', '', '', '', '', 39653),
(64012, 'ruRU', 'Припасы Легиона Смерти', 'Поговорите с герцогиней Минкс в Приюте Хранителя в Кортии.', 'Твоя борьба против Тюремщика не осталась незамеченной. Если тебе нужна сила, чтобы продолжить правое дело, я могу кое-чем помочь.', '', '', '', '', '', '', 39653),
(64007, 'ruRU', 'Наступление ковенантов', 'Вдохновите силы ковенантов перед походом в Утробу.', 'Благодаря тебе и другим героям Азерота ковенанты вернули былую силу. Но мы больше не можем сидеть и ждать следующего хода Тюремщика.\n\nПуть в Утробу открыт. Наши войска готовы выступать.\n\nКовенанты ждут твоего сигнала, $n.', '', '', '', '', '', 'Поговорите с Болваром Фордрагоном в Кортии.', 39653),
(63994, 'ruRU', 'Где пилигрим Утробы?', 'Пройдите испытание Тал-Галана.', 'Кортийские пророчества предсказывают приход пилигрима Утробы, который спасет нас от катастрофы. \n\nМожет, этот день наконец настал. А может, и нет. Мне надо проверить твою аниму, чтобы подтвердить твои слова.\n\nЕсли ты говоришь правду, мой священный долг – сначала усилить твою аниму.', '', '', '', '', '', '', 39653),
(63990, 'ruRU', 'Клинок ночи', 'Поищите зацепки в Гробнице Знаний.', 'После долгой и тяжелой охоты я все-таки вышел на след двух возможных Ночных Воительниц. Первая из них здесь, в Малдраксусе.\n\nВ этой башне собраны записи обо всех, кто прибывает в Малдраксус. Среди них некто Клинок ночи. Мне кажется, это и есть наша следующая Ночная Воительница.\n\nНа пути туда я обнаружил множество ловушек. В самой башне их наверняка еще больше. Кто-то явно хочет нам помешать.\n\nНо мы все равно не отступим.', '', '', '', '', '', '', 39653),
(63989, 'ruRU', 'Скользим со стилем', 'Проверьте заразность Чумника на Площадке терзателей.', 'Подмастерье! Я тебя искал.\n\nКевин стал таким прекрасным помощником в наших экспериментах, что я планирую обучить и других слизнюков!\n\nНе хочешь взять с собой Чумника и проверить его способность заражать органические существа?', '', '', '', '', '', '', 39653),
(63987, 'ruRU', 'Пропавшая посылка Ве\'лора', '', '', '', '', '', '', '', '', 39653),
(63986, 'ruRU', 'Тазавеш: в поисках утраченного артефакта', 'Войдите в Тазавеш и победите Со\'лею.', 'Тебе придется еще раз применить силу, дорогой друг. Стража Тазавеша нас просто так не пропустит.\n\nНо Со\'лею надо остановить. И если нам придется обойтись с ними несколько... жестковато, такие меры будут оправданы. \n\nПриведи с собой друзей. Что-то мне подсказывает, что охрана Тазавеша не так проста.', '', '', '', '', '', '', 39653),
(63985, 'ruRU', 'Тайный рынок', 'Отправляйтесь на барже до Тазавеша.', 'Дай угадаю... Тебя прислал Та\'оку, так?\n\n<Та\'мери смотрит на протянутую монетку.>\n\nЗначит, ты хочешь добраться до Тазавеша. Обычно мы не помогаем в этом чужакам, но раз оплата уже обговорена, я с удовольствием доставлю тебя куда следует.\n\nМожешь проходить, только во время поездки ни в коем случае не высовывай конечности за борт. Промежуток непредсказуем.', '', '', '', '', '', '', 39653),
(63984, 'ruRU', 'Монеты для паромщика', 'Поговорите с Та\'мери в Орибосе.', 'Ты $gвыполнил:выполнила; свою часть сделки, пилигрим. Так что теперь об оплате.\n\nМежду Орибосом и Тазавешем ходит баржа, которой владеет мой картель. Обычно на ней переправляют только товары, но порой мы можем... сделать исключение.\n\nОтдай эту монетку Та\'мери, и тебе обеспечат безопасный проезд к рынку.\n\nДальше мы уже за тебя не отвечаем.\n\n<Та\'оку кланяется, и у него вырывается нечто похожее на смешок.>', '', '', '', '', '', 'Поговорите с Та\'мери в Орибосе.', 39653),
(63983, 'ruRU', 'Проблемный груз', 'Добудьте прототип аквилона.', 'Та\'нла обратился ко мне с весьма... специфическим заказом для своего клиента.\n\nКирии разрабатывают новый вид центурионов. Они назвали его \"аквилон\". Я послал несколько специалистов картеля добыть этот прототип, но они так и не вернулись. \n\nА раз у меня нет заказа, я не могу его отправить Та\'нла. Здесь мы можем помочь друг другу.\n\nЕсли ты найдешь аквилона и приведешь его сюда, я помогу тебе попасть в Тазавеш.', '', '', '', '', '', '', 39653),
(63982, 'ruRU', 'Это выше моих полномочий', 'Пройдите через портал на Ночном рынке и поговорите с Та\'оку.', 'Да, я знаю, где находится Тайный рынок. Но, к сожалению, едва ли смогу тебя туда доставить.\n\nОднако если ты окажешь мне услугу, я представлю тебя тому, кто поможет проникнуть на рынок. Один охотник за головами часто бывает на транзитной станции Та, гавани брокеров в Бастионе. Лучше него проводника не найти... и к тому же он у меня в долгу.\n\nВстреться с Та\'оку и скажи, что ты от Та\'нла.\n\nДля удобства можешь пройти туда через этот портал. Мы же как-никак партнеры, верно?', '', '', '', '', '', 'Поговорите с охотником за головами Та\'оку на транзитной станции Та.', 39653),
(63980, 'ruRU', 'Поиски контрабандистов', 'Поговорите с Та\'нла Распознавателем на Ночном рынке.', 'Мы, брокеры, давно решили, что лучше не задерживаться на одном месте и не привлекать к себе внимания.\n\nНаши города и станции разбросаны по всему Промежутку и часто перемещаются.\n\nКак назло, я больше не могу отследить местонахождение Тазавеша.\n\nДумаю, лучший вариант – попросить доступ у картеля Та. Они гордятся тем, что ведут учет всех подобных перемещений.\n\nДавай обратимся к брокерам на ночном рынке в Ревендрете. Они наверняка будут посговорчивее своих коллег из Орибоса.', '', '', '', '', '', 'Поговорите с Та\'нла Распознавателем на Ночном рынке Ревендрета.', 39653),
(63979, 'ruRU', 'Не проливая свет', 'Найдите путевой лист картеля Со.', 'Глава картеля Со может навлечь страшную беду на Темные Земли, пилигрим.\n\nЕе зовут Со\'лея. Она хочет собрать воедино артефакт Предвечных и использовать его в своих корыстных целях.\n\nСчитается, что части этой реликвии спрятаны в твоем родном мире, на Азероте. Брокеры никогда еще туда не добирались. Но если Со\'лея это сделает, Азерот окажется в опасности.\n\nМы должны перехватить ее.\n\nНедалеко отсюда готовят к отправке груз для картеля Со. Если мы прочитаем путевой лист, то можем напасть на ее след.', '', '', '', '', '', '', 39653),
(63977, 'ruRU', 'Внутренние дела', 'Поговорите с брокерами из разных картелей в Орибосе.', 'Я один из ведущих экспертов по культуре брокеров, но у картелей сложные отношения, и картина все время меняется.\n\nЗдесь, в Орибосе, есть несколько брокеров из картеля Со. Значит, другие брокеры могут знать о них нечто неизвестное мне. Походи, поспрашивай – у тебя хорошая репутация, наверняка тебе расскажут что-нибудь полезное.', '', '', '', '', '', '', 39653),
(63976, 'ruRU', 'Аль\'манах Орибоса', 'Встретьтесь с таинственным незнакомцем в Орибосе.', 'А, пилигрим Утробы. У меня для тебя послание.\n\nНекто хочет сделать тебе особое предложение. Я не знаю подробностей. Меня только попросили пригласить тебя на встречу в одном из задних помещений \"Идиллии\".', '', '', '', '', '', 'Встретьтесь с таинственным незнакомцем в Орибосе.', 39653),
(63973, 'ruRU', 'Два дромана', 'Помогите дроману Алиот расчистить дорогу и убить лорда Дретнала.', 'Успокойся, $p. Дыши глубже.\n\n<Творец Снов дышит медленно и ровно.>\n\nНаше положение становится все напряженнее, но тебе $gсамому:самой; совсем не обязательно быть на взводе.\n\nВсе будет хорошо. Если не веришь мне, взгляни на мощь дромана Алиот с дроманом Ташмур и убедись $gсам:сама;.\n\nОни пошли вверх по холму, чтобы расчистить остальным путь. Они в один момент со всем разберутся.', '', '', '', '', '', 'Встретьтесь с лордом Герном на мосту над разрастающимся мраком.', 39653),
(63971, 'ruRU', 'Раздавить улиток', 'С помощью жезла Лунной Ягоды превратите 15 ослабленных врагов в улиток, а потом раздавите их!', 'Следи, куда шагаешь. Ты же не хочешь нечаянно раздавить Верного Утробе?\n\nХочешь, конечно! Это же весело!\n\n<Леди Лунная Ягода хихикает и показывает на улиток у своих ног.>\n\nДавить Верных Утробе гораздо легче, если сперва превратить их в противных мелких улиточек.\n\nДержи мой жезл. Можешь испытывать его на всех, кто под руку попадется.\n\nНаверное, их сначала придется ослабить, но жезл работает почти всегда!', '', '', '', '', '', 'Встретьтесь с лордом Герном на мосту над разрастающимся мраком.', 39653),
(63970, 'ruRU', 'Спасти все души до единой', 'Возьмите колыбель Тирнакса, спасите $3oa |4заблудшего друида:заблудших друидов:заблудших друидов; и отошлите их к Тирнаксу.', 'Слышишь крики замученных душ, которых поглотила Горгоа?\n\nКошмарная река душ несет свои воды, раздувшись от мучений и агонии своих безвинных жертв.\n\nОтряд душ друидов храбро ступил в эту реку, чтобы спасать заблудших. Но боюсь, многие не выдержали страдания и сами стали жертвами.\n\nПризови все свое мужество и войди в реку вместе с моей колыбелью. Если найдешь заблудшие души, помести их в колыбель, а затем отошли ее ко мне.', '', '', '', '', '', 'Встретьтесь с Тирнаксом на мосту над разрастающимся мраком.', 39653),
(63969, 'ruRU', 'Надвигающаяся тьма', 'Соберите $1oa |4книгу:книги:книг; ритуалов Верных Утробе, $2oa |4обрывок:обрывка:обрывков; депеши и $3oa |4темный мозг:темных мозга:темных мозгов;.', 'Королева Зимы призвала сюда Охоту из-за вестей об огромном облаке неестественного мрака, наползающем с севера.\n\nДикая Охота отважна, но не глупа. Мы должны узнать об этой тьме все, что сможем, а не кидаться в нее наугад.\n\nПоищи какие-нибудь зацепки на телах врагов.', '', '', '', '', '', 'Встретьтесь с лордом Герном на мосту над разрастающимся мраком.', 39653),
(63964, 'ruRU', 'Задание брокеров: Мрачный Коготь', 'Убейте Мрачного Когтя и добудьте большой оссеинизированный клюв.', 'В новых землях открываются новые возможности. Мы готовы обменять ценности из нашего запаса на неповрежденный клюв зверя по имени Мрачный Коготь.\n\nСлабонервным поставщикам просьба не беспокоиться.\n\nОбразцы приносите Та\'наси в Приют хранителя.', '', '', 'Мрачный Коготь', '', '', '', 39653),
(63963, 'ruRU', 'Задание брокеров: Железная Лапа', 'Убейте Железную Лапу и добудьте толстую шкуру с шипами.', 'В новых землях открываются новые возможности. Мы готовы обменять ценности из нашего запаса на шипастую шкуру зверя по имени Железная Лапа.\n\nСлабонервным поставщикам просьба не беспокоиться.\n\nОбразцы приносите Та\'наси в Приют хранителя.', '', '', 'Железная Лапа', '', '', '', 39653),
(63962, 'ruRU', 'Записи наблюдений', 'Соберите $1oa |4запись:записи:записей; наблюдений на Площадке терзателей в Кортии.', 'Приветствую тебя, пилигрим Утробы. Не уделишь мне минутку?\n\nКак ты, наверное, уже знаешь, мой картель тайно разместил по всей Кортии наблюдательные устройства. Но мы не можем проанализировать данные, пока не соберем их. Я попрошу это сделать тебя.\n\nПриборы на Площадке терзателей уже должны были записать достаточно. Ты не увидишь сами устройства, но собранные данные появятся перед тобой в виде яркой сферы.\n\nПринеси мне эту информацию, и я щедро тебе заплачу.', '', '', '', '', '', '', 39653),
(63961, 'ruRU', 'Запечатанные секреты', 'Найдите $1oa |4запертый контейнер:запертых контейнера:запертых контейнеров; на Площадке терзателей.', 'Кортия... Какие секреты она таит?\n\nМои помощники не покладая рук обследуют эти несчастные земли, разыскивая всякие любопытные вещицы. Ничего особенно важного, уверяю тебя.\n\nОни поместили свои находки в специальные ящики, которые следует забрать с Площадки терзателей. Не волнуйся: прочнейшие печати на этих ящиках защитят и содержимое, и курьера.\n\nПринеси мне запертые контейнеры, и я щедро тебя вознагражу.', '', '', '', '', '', '', 39653),
(63960, 'ruRU', 'Записи наблюдений', 'Соберите $1oa |4запись:записи:записей; наблюдений на Обветренном утесе и в эстуарии Пробуждения в Кортии.', 'Приветствую тебя, пилигрим Утробы. Не уделишь мне минутку?\n\nКак ты, наверное, уже знаешь, мой картель тайно разместил по всей Кортии наблюдательные устройства. Но мы не можем проанализировать данные, пока не соберем их. Я попрошу это сделать тебя.\n\nПриборы на Обветренном утесе и в эстуарии Пробуждения уже должны были записать достаточно. Ты не увидишь сами устройства, но собранные данные появятся перед тобой в виде яркой сферы.\n\nНе забудь проверить в пещерах под землей!\n\nДобудь эту информацию, и я щедро тебе заплачу.', '', '', '', '', '', '', 39653),
