(63955, 'ruRU', 'Запечатанные секреты', 'Найдите $1oa |4запертый контейнер:запертых контейнера:запертых контейнеров; в Хранилище Кортии.', 'Кортия... Какие секреты она таит?\n\nМои помощники не покладая рук обследуют эти несчастные земли, разыскивая всякие любопытные вещицы. Ничего особенно важного, уверяю тебя.\n\nОни поместили свои находки в специальные ящики, которые следует собрать вокруг Хранилища. Не волнуйся: прочнейшие печати на этих ящиках защитят и содержимое, и курьера.\n\nПринеси мне запертые контейнеры, и я щедро тебя вознагражу.', '', '', '', '', '', '', 39653),
(63954, 'ruRU', 'Запечатанные секреты', 'Найдите $1oa |4запертый контейнер:запертых контейнера:запертых контейнеров; на Форуме Искателей.', 'Кортия... Какие секреты она таит?\n\nМои помощники не покладая рук обследуют эти несчастные земли, разыскивая всякие любопытные вещицы. Ничего особенно важного, уверяю тебя.\n\nОни поместили свои находки в специальные ящики, которые следует забрать с Форума Искателей. Не волнуйся: прочнейшие печати на этих ящиках защитят и содержимое, и курьера.\n\nПринеси мне запертые контейнеры, и я щедро тебя вознагражу.', '', '', '', '', '', '', 39653),
(63951, 'ruRU', 'Темное место', 'Войдите в разлом с помощью несбалансированного камня разлома и освободите из ловушек $1a |4воркая - пленника разлома:воркаев - пленников разлома:воркаев - пленников разлома;.', 'Мироздание сложнее, чем кажется, $p. Одни слои реальности накладываются на другие.\n\nЛовушки Тюремщика затягивают наших воинов в один из таких разломов, недоступных обычному зрению.\n\nМне удалось добыть несбалансированный камень разлома. С ним ты сможешь пройти в разлом и уничтожить ловушки, удерживающие наших солдат. Спаси их, пока они не сгинули навсегда.\n\nУничтожив темные ловушки, возвращайся обратно и вытащи пойманных воинов в нашу реальность.', '', '', '', '', '', 'Встретьтесь с маркграфиней Син\'дейн на мосту над разрастающимся мраком.', 39653),
(63950, 'ruRU', 'Когти бритвокрылов', 'Принесите $1oa |4коготь:когтя:когтей; бритвокрылов.', 'Мои охотники пока плохо знают эти земли, но мы наткнулись на опасных местных зверей.\n\nВ том числе бритвокрылов, злобных хищников со страшными когтями... и норовом, как у воркай.\n\n<Герн свирепо ухмыляется.>\n\nПринеси их когти, покажу новичкам. Пусть знают, что их тут ждет.', '', '', '', '', '', '', 39653),
(63949, 'ruRU', 'Определяя судьбу', 'Сорвите наступление Тюремщика в Кортии и Утробе, участвуя в штурмах Утробы, выполняя ежедневные задания, добывая сокровища, убивая редких существ и побеждая мучителей из Торгаста.', 'Мощь и злоба Тюремщика продолжают расти. И, подобно им, должна вырасти наша решимость.\n\nВстань плечом к плечу с товарищами, $n. Отгони тьму, угрожающую пожрать нас всех.\n\nВместе у нас еще есть шанс на победу.\n\nДа направит тебя Предназначение.', '', '', '', '', '', '', 39653),
(63944, 'ruRU', 'Кортия ждет', 'Поговорите с Тал-Галаном в Приюте Хранителя в Кортии.', 'Готовься, $n. Наши союзники ждут тебя в Кортии.', '', '', '', '', '', '', 39653),
(63936, 'ruRU', 'Поглощенная анима', 'Добудьте $1oa ед. поглощенной анимы у пожирателей в Эстуарии Пробуждения.', 'У Сики идея!\n\nПожиратели, они... пожирают. Они едят что угодно! Значит, аниму тоже.\n\nЕсли забрать аниму у пожирателей, то она вся наша!', '', '', '', '', '', '', 39653),
(63935, 'ruRU', 'Заветные корни', 'Добудьте $1oa ед. осадка анимы в Хранилище Кортии.', 'Кортия... страдающая роща-сестра.\n\nНо среди агонии разорения еще жива надежда. \n\nСобери аниму и возроди эти земли.', '', '', '', '', '', '', 39653),
(63934, 'ruRU', 'Возвращение сообщения', 'Верните $1oa |4украденное послание:украденных послания:украденных посланий; из Обители ученых.', 'Приветствую, $gсмертный:смертная;!\n\nМне приказали доставить послания нашим союзникам в Кортию. Но я не смогла выполнить поручение.\n\nВерные Утробе украли сообщения, которые меня запрограммировали отнести, и некорректно разложили их на земле.\n\nТы не $gмог:могла; бы собрать послания и вернуть их мне? Я доставлю их адресатам.\n\nСпасибо!', '', '', '', '', '', '', 39653),
(63924, 'ruRU', 'Фетиш-коготь горака', 'Принесите фетиш-коготь горака архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого фетиша в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63923, 'ruRU', 'Гравюра на дереве семьи Лан', 'Принесите гравюру на дереве семьи Лан архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этой гравюры в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63922, 'ruRU', 'Рассекатель теней', 'Принесите рассекатель теней архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого клинка в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63921, 'ruRU', 'Кольцо самосозерцания', 'Принесите кольцо самосозерцания архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого кольца в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63920, 'ruRU', 'Загадочный декодер', 'Принесите загадочный декодер архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого устройства в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63919, 'ruRU', 'Книга сковывания: \"Замученный колдун\"', 'Добудьте $1oa |4лазурную страницу:лазурные страницы:лазурных страниц; и принесите их архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Из книги доносится приглушенный голос вперемешку с треском помех. Большую часть слов не разобрать, но голос повторяет одну и ту же просьбу – найти лазурные страницы.\n\nПролистав книгу, вы обнаруживаете, что многих страниц не хватает.\n\nЕсли вам удастся найти недостающие страницы, архивариус отреставрирует фолиант.>', '', '', '', '', '', '', 39653),
(63918, 'ruRU', 'Тотем предвестья беды', 'Принесите тотем предвестья беды архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого обелиска в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63917, 'ruRU', 'Вечно живая статуэтка', 'Принесите вечно живую статуэтку архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этой статуэтки в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63916, 'ruRU', 'Мешок со странной землей', 'Принесите мешок со странной землей архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этой земли в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63915, 'ruRU', 'Барабан лоа смерти', 'Принесите барабан лоа смерти архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого барабана в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63914, 'ruRU', 'Шифр понимания', 'Принесите шифр понимания архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого шифра в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63913, 'ruRU', 'Нестабильная взрывчатая сфера', 'Принесите нестабильную взрывчатую сферу архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого устройства в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63912, 'ruRU', 'Небесная схема Темных Земель', 'Добудьте $1oa |4свиток:свитка:свитков; с исследованиями по навигации в загробном мире и принесите архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы узнаете реликвию из Кодекса архивариуса.\n\nВерные Утробе посчитали ее бесполезной и выбросили.\n\nИ сейчас эта схема в самом деле бесполезна, поскольку без сопроводительных свитков по ней невозможно установить расположение загробных миров. Если собрать исследования с тел ученых, дополненную карту можно будет вернуть архивариусу.>', '', '', '', '', '', '', 39653),
(63911, 'ruRU', 'Слиток поющей стали', 'Победите Верных Утробе захватчиков, затем отнесите слиток поющей стали архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Слиток издает мелодичные переливчатые стенания.>\n\nГоре мне! Без капли жалости злодеи бьют молотом по моему телу, гнут его в угоду своим черным замыслам.\n\nЧума! Чума на их головы!\n\n<Слиток воинственно испускает пронзительный клич.>\n\nОтомсти Верным Утробе за каждый удар!', '', '', '', '', '', '', 39653),
(63910, 'ruRU', 'Звезда пустоты', 'Зарядите Звезду пустоты и принесите ее архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы узнаете реликвию из Кодекса архивариуса.\n\nИсточник энергии почти разряжен, но чистая насыщенная анима его восстановит. Ближайшие разломы как раз подойдут.>', '', '', '', '', '', '', 39653),
(63909, 'ruRU', 'Личина подменыша', 'Принесите личину подменыша архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этой маски в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63908, 'ruRU', 'Бастион божественного умысла', 'Принесите Бастион божественного умысла архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Вы хорошо изучили Кодекс архивариуса, поэтому сразу узнаете одну из пропавших реликвий.\n\nУ архивариуса Ро-Сюира найдется место для этого щита в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63904, 'ruRU', 'Сердце Арденвельда', 'Узнайте, что произошло в Сердце леса.', 'Я укрыла свою печать в Сердце леса, где силы Утробы не смогут ее отыскать.\n\nНо оттуда протрубил рог, взывающий о помощи.\n\nОтправляйся туда со своими союзниками и узнай, что произошло.', '', '', '', '', '', 'Вернитесь к Королеве Зимы к Сердцу леса.', 39653),
(63903, 'ruRU', 'Штурм Святилища', 'Победите Сильвану Ветрокрылую в Святилище Господства.', 'Тюремщик заполучил печати всех четырех ковенантов. Значит, теперь он намеревается вырваться из Утробы и похитить из Орибоса печать Арбитра.\n\nМы не можем этого допустить.\n\nНа самом верху Торгаста расположилось Святилище Господства, откуда Тюремщик правит своей армией. Пришла пора войти в это царство тьмы.\n\nСилами, которые попытаются преградить нам путь, наверняка будет командовать Сильвана Ветрокрылая. Мы должны остановить ее... и спасти Андуина Ринна из-под ее контроля.\n\nСобирай товарищей, $n. Рыцари Черного Клинка пойдут за тобой.', '', 'Королева-банши – главное звено в плане Тюремщика. Найди ее... и останови.', 'Сильвана Ветрокрылая', '', '', '', 39653),
(63902, 'ruRU', 'Отличные новости, народ!', 'Летите с Даникой в Кортию и сообщите новости Болвару.', 'Идем, мой друг. Пора оставить эту мерзость позади.\n\nТвоих товарищей, конечно, обрадуют новости о победе над Оком. Я перенесу тебя к ним.\n\nСкажи, когда можно уходить, $n.', '', '', '', '', '', '', 39653),
(63901, 'ruRU', 'Фокусировка взгляда', 'Отправляйтесь на Последнюю платформу и протрубите в Илскахорн, чтобы призвать гнев Одина.', 'Горе пополам с яростью – мощное сочетание. Этого должно быть достаточно. Ну, я так думаю. \n\nЕсли ты по-прежнему не желаешь отказываться от своего безрассудного замысла, используй рог на Последней платформе, где река душ поднимается к Торгасту. Там энергия мощнее всего.\n\nПоявление твоих сияющих союзников привлечет внимание Ока. Очень надеюсь, что ты выберешься оттуда $gневредимым:невредимой;. Я слишком много в тебя вложила.', '', 'Око Тюремщика рыщет по Утробе в поисках врагов Зоваала.', 'Око Тюремщика', '', '', '', 39653),
(63899, 'ruRU', 'Книга сковывания: \"Сумасшедшая ведьма\"', 'Добудьте $1oa |4багровую страницу:багровые страницы:багровых страниц; и принесите их архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Из книги доносится приглушенный голос вперемешку с неразборчивой руганью.  Большую часть слов не разобрать, но голос повторяет одну и ту же просьбу – найти багровые страницы.\n\nПролистав книгу, вы обнаруживаете, что многих страниц не хватает.\n\nЕсли вам удастся найти недостающие страницы, архивариус отреставрирует фолиант.>', '', '', '', '', '', '', 39653),
(63896, 'ruRU', 'Слезы проклятых', 'Соберите $1oa |4слезу:слезы:слез; проклятых в Горгоа, Реке Душ.', 'Чтобы инструмент заработал как тебе нужно, потребуется привязать его к Утробе. Для этого тебе надо наполнить его чистой, незамутненной агонией душ, плененных в этой проклятой тюрьме.\n\nЛегче всего добыть сущность горя, ее здесь предостаточно. Иди к Горгоа – туда, где проклятые души, влекомые потоком, льют горькие слезы. Эти слезы застывают кристаллами страдания.\n\nТолько будь $gосторожен:осторожна; и не поддайся их скорби.', '', '', '', '', '', 'Принесите слезы проклятых проекции Ве\'нари на берегу Горгоа.', 39653),
(63895, 'ruRU', 'Мешок с подарками', 'Испытайте транспортирующее устройство из сумки Ве\'нари.', 'Интересно... подслушивающие устройства и призрачная мантия. Забирай их, наверняка пригодятся.\n\nО! А эти вещицы я оставлю себе. Если не ошибаюсь, а я ошибаюсь очень редко... это проецирующий механизм. Полезная штука!\n\nА это что такое? Похоже на транспортирующее устройство. Мы должны немедленно его опробовать.\n\nГоворя \"мы\", я, конечно же, имею в виду тебя.', '', '', '', '', '', '', 39653),
(63892, 'ruRU', 'Рунические дощечки предсказателя', 'Найдите $1oa |4руническую дощечку:рунические дощечки:рунических дощечек; и принесите их архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<В мешочке лежит всего одна руническая дощечка. Она крутится сама по себе, будто ее вращает невидимая рука.\n\nКаменная поверхность испещрена аккуратными рунами, напоминающими письмена врайкулов. Судя по пометке на тыльной стороне, эта дощечка – часть комплекта.>', '', '', '', '', '', '', 39653),
(63867, 'ruRU', 'Управление гневом', 'Зарядите инструмент с помощью вытягивающего устройства, собрав эмоции яростных теней в реке душ.', 'Я не музыкант, хоть и люблю послушать выступления в Тазавеше.\n\nИнструмент обретет голос, когда насытится самыми сильными эмоциями.\n\nМногие из проклятых, которые томятся в реке душ, переполнены неутолимым гневом. Возьми это вытягивающее устройство и заряди его гневом яростных теней.\n\nСобранные таким образом крики ярости помогут пробиться к твоим союзникам сквозь стены Утробы.\n\nОчень сомневаюсь, что эта мелодия станет хитом.', '', '', '', '', '', 'Найдите проекцию Ве\'нари на краю Реки душ.', 39653),
(63864, 'ruRU', 'Ужасный сорт', 'Потушите $2oa |4нестабильную искру:нестабильные искры:нестабильных искр;.', 'Могильная пыль и узор-трава – ужасное сочетание, но Таббинс решил попробовать и приготовил из них чай.\n\nВкус был такой ужасный, что я вылил весь чайник в огонь. Оказалось, что этот купаж может затушить любое пламя! \n\nУ Таббинса с собой целая партия. Пусть хоть как-то пригодится! Вылей этот чай на нестабильные искры в Котле Зоваала.', '', '', '', '', '', '', 39653),
(63863, 'ruRU', 'Машина – часть прайда', 'Уничтожьте Мальфеста, Владыкоса и Гневоса.', 'Столкнувшись с серьезной напастью, мы с Немеей забываем про разногласия и действуем сообща. Ее прайд и мои анимапарды сражаются с одинаковой яростью.\n\nОкажи нам честь и позволь помочь тебе в грядущей битве.\n\nВозьми с собой Андиру или Гатаматоса и уничтожь элитных бойцов Тюремщика, что угрожают нашим войскам.', '', '', '', '', '', '', 39653),
(63861, 'ruRU', 'Начало коллекции', 'Добудьте кодекс воспоминаний и принесите его архивариусу Ро-Сюиру в Реликварий воспоминаний.', 'Давай не будем останавливаться на достигнутом и добудем главный предмет, который поможет нам во всех исследованиях: утерянный кодекс.\n\nСо временем его страницы начнут заполняться чудесными новыми знаниями – в этом он подобен самой Кортии.\n\nПоиски стоит начать в самой глубине нашего царства, в Пещере Раздумий. Ты найдешь ее к югу отсюда.\n\nБудем надеяться, слуги Тюремщика пока туда не добрались.', '', '', '', '', '', '', 39653),
(63860, 'ruRU', 'Талисман вечного исследователя', 'Принесите поврежденный талисман архивариусу Ро-Сюиру в Реликварий воспоминаний.', '<Талисман покрыт вмятинами и заляпан грязью. Бывший владелец обращался с ним очень небрежно.\n\nУ архивариуса Ро-Сюира найдется место для этого талисмана в Реликварии воспоминаний.>', '', '', '', '', '', '', 39653),
(63859, 'ruRU', 'От звона до звона', 'Защитите колокола для призыва подкрепления на западе, на востоке и на юге, а затем позвоните в них.', 'Наши распорядители должны подготовить три колокола, чтобы мы могли призывать подкрепление из Бастиона. Но из-за атак Верных Утробе им пришлось бросить работу.\n\nЗащити распорядителей, пока они работают, а затем позвони в каждый колокол, чтобы вызвать подкрепление.', '', '', '', '', '', '', 39653),
(63857, 'ruRU', 'Голоса Вечных', 'Выслушайте план действий.', '<Болвар с трепетом разглядывает исполинские фигуры перед собой и простирающиеся в бесконечность бесчисленные врата.>\n\nЭто место поистине... потрясает.\n\nУвы, у нас нет времени им восхищаться. Высокочтимый Голос должна немедленно начать собрание.', '', '', '', '', '', 'Вернитесь в Анклав Орибоса.', 39653),
(63856, 'ruRU', 'Сбор ковенантов', 'Поговорите с Тал-Инарой, чтобы попасть в покои Арбитра.', 'Тюремщик не может покинуть Утробу, но его жестокость все-таки нашла лазейку.\n\nК счастью, Архонт смогла пережить нападение. Однако я слышала, что ее рана... вызывает опасения.\n\nВечные и их союзники ждут тебя и верховного лорда Фордрагона в покоях Арбитра. Я открою тебе путь.\n\nТакова воля Арбитра.', '', '', '', '', '', '', 39653),
(63855, 'ruRU', 'Легкий путь', 'Установите связь между Кортией и убежищем Ве\'нари.', 'Кортия открывает столько новых перспектив. Ты только взгляни на эти любопытные вещицы.\n\nКонечно же, я подготовилась к таким находкам. Давай поищем подходящее место и установим более надежный проход к моему убежищу.\n\nМы с тобой еще не закончили работу.', '', '', '', '', '', '', 39653),
(63853, 'ruRU', 'Погасить пламя', 'Убейте Инфернуса Бесконечного по просьбе Теотара.', 'Ты тоже видишь? \n\nВечно маячит где-то сбоку, вне поля зрения, и так ярко светит!\n\nКак можно наслаждаться чаем, когда это напоминание об огне и пепле где-то рядом?\n\nПрошу, пилигрим, сделай одолжение... избавь меня от него, и тогда уж мы примемся за мой любимый сорт!', '', 'В нем пылает то же негасимое пламя, что и в кузницах Котла Зоваала.', 'Инфернус Бесконечный', '', '', '', 39653),
(63849, 'ruRU', 'Слуховой аппарат', 'Установите звукоуловители в Дезмотероне, чтобы помочь Ве\'нари подслушать местных обитателей.', 'Тебя перенесло именно туда, где у меня есть... определенные интересы. Какое счастливое совпадение. Поставь вокруг звукоуловители, которые я тебе дала, и попробуем установить стабильный сигнал.\n\nВ таком опасном месте надо соблюдать предельную осторожность. Призрачная мантия скроет тебя от чужих глаз.', '', '', '', '', '', '', 39653),
(63848, 'ruRU', 'Проявление благодарности', 'Поговорите с Ве\'нари в Покое Хранителя в Кортии.', 'Твое присутствие – знак того, что древнее пророчество начинает сбываться, пилигрим. Я знаю, ты со своими союзниками спасешь нас.\n\nМожет, я поспешил с суждением о том брокере, твоей подруге. В конце концов, она же привела тебя в Кортию.\n\nПередай нашу благодарность Ве\'нари. Мы с радостью ответим на ее вопросы.\n\nКажется, у нее их... немало.', '', '', '', '', '', '', 39653),
(63845, 'ruRU', 'Гнев Одина', 'Узрите, как валь\'киры получат мощь Одина и установят связь с Илскахорном.', 'Мы выковали рог и избрали достойнейших.\n\nТеперь, $n, осталось только связать моих лучших валь\'кир с рогом и наполнить их моей мощью, чтобы они явили мой гнев врагам.\n\nПонаблюдай за ритуалом вместе со мной.', '', '', '', '', '', '', 39653),
(63844, 'ruRU', 'Избранные', 'Отправляйтесь в Круг Славы и сразитесь с валь\'кираами, чтобы определить самых достойных.', 'Мне нужно больше валь\'кир, чтобы помочь Данике в будущих сражениях. $n, тебе выпала честь выбрать достойнейших из них.\n\nСамые сильные должны доказать свое превосходство в Круге Славы. Сражайся в полную силу, |3-6($c). Не опозорь свое оружие.', '', '', '', '', '', '', 39653),
(63842, 'ruRU', 'Отличный розыгрыш', 'Уменьшите 15 противников и увеличьте $2oa |4крысу Утробы:крысы Утробы:крыс Утробы; в Тремакулюме!', 'Я так зла на этих мучителей!..\n\nСлуги Тюремщика пытают добрые души, которые несправедливо сюда направили! Пользуются тем, что за них некому заступиться!\n\nНо теперь я здесь, и я знаю, что надо делать.\n\nПомоги мне накормить палачей их собственным лекарством!', '', '', '', '', '', 'Встретьтесь с принцем Ренаталом под лестницей в Тремакулюме.', 39653),
(63841, 'ruRU', 'Небесная охота', 'Воспользуйтесь копьем Корейн, чтобы сбить на землю и прикончить $2oa |4Верного Утробе небесного охотника:Верных Утробе небесных охотников:Верных Утробе небесных охотников;.', 'Красавчик Калош и другие крупные землерои страдают от налетов сверху.\n\nЗемлерои не дотягиваются до крылатых врагов, но Дикая Охота может достать любую добычу.\n\nВозьми мое копье и сбивай на землю Верных Утробе, которые кружат над западным мостом.\n\nПосле этого с ними будет легко разделаться.\n\nМои охотники тебе помогут, замедляя крылатых врагов.', '', '', '', '', '', 'Встретьтесь с принцем Ренаталом под лестницей в Тремакулюме.', 39653),
(63839, 'ruRU', 'Даже одна – это достаточно', 'Осматривайте недостойные души в Тремакулюме, пока не найдете одну по-настоящему достойную.', 'Я своими глазами видела, как достойные души низвергались в Утробу.\n\nСлуги Лорда-камергера чуть не бросили туда Гресита, который с тех пор так хорошо себя проявил под моей опекой.\n\nОсмотри души, которые грязные слуги Тюремщика сочли \"недостойными\". Проверь каждую и убедись, что они заслужили право находиться здесь.\n\nЕсли мы осмотрим все души в Тремакулюме и найдем хоть одну достойную вернуться с нами в Ревендрет, эти усилия не будут напрасными.', '', '', '', '', '', 'Встретьтесь с принцем Ренаталом под лестницей в Тремакулюме.', 39653),
(63838, 'ruRU', 'Испытание дуэлянта', 'Попросите Красавчика Калоша забросить вас на верхнюю часть укреплений, а затем сразитесь с командирами Верных Утробе.', '<Наджия поворачивается к вам, не переставая парировать атаки Верных Утробе.>\n\nКак видишь, у нас тут на баррикадах забот хватает.\n\nЯ буду сдерживать натиск здесь, а ты разберись с командирами Верных Утробе.\n\nВызови их на бой и победи на виду у подчиненных.\n\nНикакой пощады, $p. Всели в них отчаяние.', '', '', '', '', '', 'Встретьтесь с принцем Ренаталом под лестницей в Тремакулюме.', 39653),
(63836, 'ruRU', 'Фан-клуб Клыкоклаца', 'Убейте $1oa |4противника:противников:противников; из Торгаста, которых вытащит из портала Клыкоклац.', 'Клыкоклац – самый сильный из землероев! Он просто невероятен!\n\nОн там, внизу. Сует руку в здоровенный портал и вытаскивает поганцев из Торгаста!\n\nЧаще всего они вообще не понимают, что происходит, ха-ха!\n\nМы с Дуборылом сразу стали его главными фанатами.\n\nТоже хочешь вступить в наш фан-клуб? Можешь заработать приглашение в общем порядке: иди вниз и дерись с теми, кого Клыкоклац достает из портала!', '', '', '', '', '', 'Встретьтесь с принцем Ренаталом под лестницей в Тремакулюме.', 39653),
(63834, 'ruRU', 'Оружие Тремакулюма', 'Добудьте $1oa ед. оружия Верных Утробе, $2oa |4жуткую корону:жуткие короны:жутких корон; и $3oa |4око тени:ока тени:очей тени;.', 'Вентиры Грехопада не тратят души понапрасну, а камнерожденные ценят хорошее оружие.\n\nДобудь оружие наших врагов, и мы вооружим им нашу армию.', '', '', '', '', '', 'Встретьтесь с принцем Ренаталом под лестницей в Тремакулюме.', 39653),
(63833, 'ruRU', 'Террор в Тремакулюме', 'Убейте $1oa |4противника:противников:противников; в Тремакулюме.', 'Я не сомневаюсь, что у моих соратников и генералов найдутся для тебя более конкретные поручения.\n\nНо моя просьба простая. Враги окружают нас со всех сторон.\n\nОтбрось их, чтобы у нас появилось пространство для маневра.', '', '', '', '', '', 'Встретьтесь с принцем Ренаталом под лестницей в Тремакулюме.', 39653),
(63831, 'ruRU', 'Голос ярости', 'Помогите великому кузнецу Хелгару в кузне.', 'Я покараю тех, кто напал на валь\'кир!\n\nТы станешь главным моим орудием, |3-6($c). Все видели сегодня, на какую отвагу ты $gспособен:способна;. Прояви ее еще раз, вынудив мое Око вступить в бой.\n\nНо сначала просьба попроще... Надо выковать рог, который призовет мой гнев. Кузнец Хелгар тебе в этом поможет.', '', '', '', '', '', '', 39653),
(63829, 'ruRU', 'Больше здесь никто не парит', 'Спасите $1oa |4запертого претендента:запертых претендентов:запертых претендентов;.', 'Нам представился шанс освободить тех, кого мы считали навсегда потерянными!\n\nТюремщик пленил множество наших претендентов, чтобы сделать из них бойцов своей армии. Тех, кто ему воспротивился, держат в этих парящих камерах в надежде, что рано или поздно они будут сломлены. \n\nРазбей цепи Господства и освободи запертых в клетках претендентов.', '', '', '', '', '', '', 39653),
(63828, 'ruRU', 'У меня больше', 'Уничтожьте големов Тюремщика с помощью центуриона-разрушителя.', 'Тюремщик бросил в бой армию недавно выкованных големов, чтобы подавить наше сопротивление. К счастью, у меня все готово к такому повороту событий. \n\nНаш самый крупный центурион поможет отразить эту атаку.\n\nСтупай вместе с ним, пилигрим Утробы, и направь его удары.', '', '', '', '', '', '', 39653),
(63827, 'ruRU', 'Слова поддержки', 'Зачитайте кодекс $1oa |4изможденному защитнику:изможденным защитникам:изможденным защитникам;.', 'Наши войска яростно сражаются уже который час. Но бой выматывает их и приводит в отчаяние.\n\nВозьми этот кодекс и зачитай его бойцам. Текст покажется бессмысленным, но пусть тебя это не смущает – в этих словах сокрыта невероятная мощь.\n\nПрочитай их изможденным защитникам и вдохни в них надежду.', '', '', '', '', '', '', 39653),
(63824, 'ruRU', 'Атака кирий', 'Завершите $1oa |4задание:задания:заданий; в цитадели Вечных Мук и Лике Забвения.', 'Нам удалось застать силы Тюремщика врасплох. Мы захватим цитадель Вечных Мук и разделаемся с ее защитниками у Алтаря Господства!\n\nНам очень нужна твоя помощь, пилигрим Утробы. Помоги нашим войскам в бою!', '', '', '', '', '', '', 39653),
(63823, 'ruRU', 'Атака ночного народца', 'Завершите $1oa |4задание:задания:заданий; в цитадели Вечных Мук и Лике Забвения.', 'Нам удалось застать силы Тюремщика врасплох. Мы захватим цитадель Вечных Мук и разделаемся с ее защитниками у Алтаря Господства!\n\nНам очень нужна твоя помощь, пилигрим Утробы. Помоги нашим войскам в бою!', '', '', '', '', '', '', 39653),
(63822, 'ruRU', 'Атака вентиров', '', '', '', '', '', '', '', '', 39653),
(63811, 'ruRU', 'Сплошная ненависть', 'Проводите Данику в Великий медовый зал и расскажите Одину о том, что делает Хелия.', 'Когда первые из моих сестер пропали, мы забеспокоились. Но те, что отправились на их поиски, не вернулись. И те, кто последовал за ними, тоже.\n\nТеперь мы знаем, что нас подло предала та, кому мы доверяли.\n\nИдем. Надо рассказать Одину о том, что мы видели в Утробе.\n\nОн придет в ярость.', '', '', '', '', '', '', 39653),
(63810, 'ruRU', 'Пух и перья', 'Идите по следу из золотых перьев и найдите существо, которое их обронило.', 'Я видела в Утробе много черных крыльев, но ярко-золотых – ни разу.\n\nБлагодаря четкому сигналу звукоуловителей мы теперь можем узнать, откуда взялись эти перья.\n\nИди по их следу, пилигрим. Здесь кроется какая-то тайна – и, весьма возможно, шанс заработать.\n\nЗолото же очень ценится в твоем мире, так ведь?', '', '', '', '', '', '', 39653),
(63794, 'ruRU', 'Задание брокеров: голодающее чудище', 'Добудьте существенное количество крови пожирателя у голодающего чудища.', 'В новых землях открываются новые возможности. Мы готовы обменять ценности из нашего запаса на существенное количество крови пожирателей, предпочтительно самых крупных.\n\nСлабонервным поставщикам просьба не беспокоиться.\n\nОбразцы приносите Та\'наси в Приют хранителя.', '', '', 'Голодающее чудище', '', '', '', 39653),
(63793, 'ruRU', 'Задание брокеров: Энсидий Осквернитель', 'Убейте Энсидия Осквернителя.', 'Крылатый Верный Утробе, известный как Энсидий Осквернитель, нарушает планы картеля в Кортии.\n\nУбивший этого злодея получит вознаграждение. \n\nРекомендуется крайняя осторожность – Энсидий так силен, что лучше не нападать на него в одиночку.', '', '', 'Энсидий Осквернитель', '', '', '', 39653),
(63792, 'ruRU', 'Задание брокеров: Ноктюрнус Развоплотитель', 'Убейте Ноктюрнуса Развоплотителя.', 'Злобный колдун из Утробы, известный как Ноктюрний Развоплотитель, нарушает планы картеля в Кортии.\n\nУбивший этого злодея получит вознаграждение. \n\nРекомендуется крайняя осторожность – Ноктюрний так силен, что лучше не связываться с ним в одиночку.', '', '', 'Ноктюрнус Развоплотитель', '', '', '', 39653),
(63791, 'ruRU', 'Задание брокеров: Валдинар Окаянный', 'Убейте Валдинара Окаянного.', 'Среди Верных Утробе есть могучий воин в покрытой шипами броне – Валдинар Рожденный Проклятым. Он мешает планам картеля в Кортии.\n\nУбивший этого злодея получит вознаграждение. \n\nРекомендуется крайняя осторожность – Валдинар так силен, что лучше не нападать на него в одиночку.', '', '', 'Валдинар Окаянный', '', '', '', 39653),
(63790, 'ruRU', 'Задание брокеров: лорд Аззорак', 'Убейте лорда Аззорака.', 'Могучий повелитель ужаса, известный как лорд Аззорак, нарушает планы картеля в Кортии.\n\nУбивший этого злодея получит вознаграждение. \n\nРекомендуется крайняя осторожность – Аззорак так силен, что лучше не нападать на него в одиночку.', '', '', 'Лорд Аззорак', '', '', '', 39653),
(63789, 'ruRU', 'Неустанная борьба: Обитель ученых', 'Очистите Обитель ученых от Верных Утробе.', 'Мы не можем допустить, чтобы Верные Утробе закрепились так близко от нашего собственного лагеря. Смотрители говорят, что наше убежище замаскировано от дозорных, но их соседство все равно нервирует меня.\n\nИди в Обитель ученых и очисти ее от слуг Тюремщика.', '', '', '', '', '', '', 39653),
(63788, 'ruRU', 'Неустанная борьба: Святилище наставлений', 'Избавьтесь от пожирателей в Святилище наставлений.', 'Тюремщик уничтожил дом смотрителей, но мы еще можем помочь им в эти тяжелые времена.\n\nТут рядом находится так называемое Святилище наставлений. Смотрители говорят о нем с благоговением и скорбью. Туда они ходят молиться и постигать суть. Но сейчас оно кишит пожирателями.\n\nОчисти святилище, чтобы Смотрители могли вновь найти утешение в своих молитвах и ритуалах.', '', '', '', '', '', '', 39653),
(63787, 'ruRU', 'Неустанная борьба: Площадка терзателей', 'Зачистите Площадку терзателей от сланцевиков.', 'Мои шпионы докладывают, что Площадка терзателей находится рядом с новой дорогой из Утробы в Кортию. Она дала бы нам тактическое и стратегическое преимущество.\n\nК несчастью, там обитают сланцевики.\n\nЕсли мы захватим эту область, нам откроется удобная дорога на запад. Кроме того, оттуда мы сможем наблюдать за войсками Тюремщика.', '', '', '', '', '', '', 39653),
(63786, 'ruRU', 'Атака на Обветренный утес', 'Отправьтесь на Обветренный утес и уничтожьте противников.', 'Небеса над Кортией полны опасностей.\n\nНам угрожают не только Верные Утробе, но и местные враждебные создания. Надо защитить от их нападений наших крылатых союзников и ручных зверей.\n\nЗдешние крылатые существа гнездятся на Обветренном утесе. Отправляйся туда и избавься от этих агрессивных тварей.\n\nТогда мы сможем спокойно подниматься в небо.', '', '', '', '', '', '', 39653),
(63785, 'ruRU', 'Неустанная борьба: Форум Искателей', 'Очистите Форум Искателей в Кортии от войск Тюремщика.', 'Армия Зоваала продолжает опустошать эти земли своими набегами.\n\nМы должны преподать им урок. Покажи, что мы не отступим, $n.\n\nПомни, что с тобой сила всего Арденвельда.', '', '', '', '', '', '', 39653),
(63784, 'ruRU', 'Золото не вопрос', 'Добудьте $1oa |4тусклого громита:тусклых громитов:тусклых громитов;.', '$p! Как твои делишки?\n\nМы слышали, в этой Кортии куча всего интересного.\n\nЗнаешь таких прыгунов-невидимок? Которых в упор не видишь... потому что у них зеркальная шкура. Так вот мы с ребятами хотим под ней, так сказать, сныкаться. От всяких там боссов.\n\nПоймай-ка мне побольше этих прыгунов. Золото не вопрос, только принеси паршивцев живыми.', '', '', '', '', '', '', 39653),
(63783, 'ruRU', 'Изъятие анимы', 'Добудьте $1oa ед. поглощенной анимы у пожирателей в Святилище наставлений.', 'Чтобы продолжать борьбу, нам нужен постоянный приток свежих солдат, припасов и анимы. По понятным причинам последнее найти сложнее всего. Но трудности научили меня изобретательности.\n\nНедалеко отсюда есть обильный источник анимы – пожиратели, которыми кишит Святилище наставников. Конечно, аниму проще извлекать из душ, чем из пожирателей, но результат тот же. Если тебе хватит силы. Ну как, решишься?', '', '', '', '', '', '', 39653),
(63782, 'ruRU', 'Ритуалы Верных Утробе', 'Принесите $1oa |4гримуар:гримуара:гримуаров; Верных Утробе.', 'В армии Верных Утробе нет числа заклинателям и колдунам. Их магия незнакома нам и потому смертельно опасна.\n\nЧтобы организовать защиту, нам нужно понять, на что они способны. И потом, мне тоже любопытно узнать про их методы и ритуалы.\n\nВыследи этих чародеев и принеси мне их гримуары.', '', '', '', '', '', '', 39653),
(63781, 'ruRU', 'Боевые планы Верных Утробе', 'Добудьте боевые планы Верных Утробе.', 'Что больше навредит врагу – если мы уничтожим часть его войска или если оборвем каналы связи?\n\nИли еще лучше: если мы перехватим сообщения и устроим засаду на подкрепление?\n\nВижу, ты $gпонял:поняла; мою мысль. По северной дороге к Кортии ездит офицер Верных Утробе. Найди его, убей и забери боевые планы.', '', 'Этот могучий командир перевозит планы Верных Утробе между Утробой и Кортией.', 'Лейтенант Воксифер', '', '', '', 39653),
(63780, 'ruRU', 'Отплатим той же монетой!', 'Добудьте $1oa |4эмблему:эмблемы:эмблем; Верных Утробе.', 'Меня охватывает гнев от одной мысли о том, что армия Тюремщика вторглась в Арденвельд! \n\nА в таком состоянии я мщу.\n\nТочнее, прошу тебя отомстить! Уничтожь Верных Утробе и принеси их эмблемы, чтобы я сосчитала жертвы. \n\nМне все равно, у кого ты их достанешь – лишь бы у тех негодяев из Утробы!', '', '', '', '', '', '', 39653),
(63779, 'ruRU', 'Подобие порядка', 'Соберите $1oa |4подношение из святилища:подношения из святилищ:подношений из святилищ;.', 'Мы должны помочь смотрителям Кортии, $p. Они лишились практически всего, причем так внезапно.\n\nНеподалеку есть Святилище наставлений, где они оставляли подношения у алтарей. Когда Верные Утробе вторглись в Кортию, смотрителям пришлось покинуть святилище и бросить все подношения там.\n\nЕсли ты соберешь их и вернешь обратно, у смотрителей появится хотя бы подобие нормальной жизни.', '', '', '', '', '', '', 39653),
(63778, 'ruRU', 'Мы смотрим в будущее', 'Добудьте $1oa ед. краденой анимы в Обители ученых в Кортии.', 'У меня разрывается сердце при виде еще одного уничтоженного царства. Только представь, какой прекрасной Кортия была раньше.\n\nНо хватит скорбеть об утраченном. Ара\'лон научил меня, что мы не должны сидеть сложа руки.\n\nЕсть и другой выбор – сражаться дальше.\n\nТы поможешь нам в этом, если отберешь у Верных Утробе аниму. Пусть послужит благому делу: усилит наши войска и укрепит оборону.', '', '', '', '', '', '', 39653),
(63777, 'ruRU', 'Запечатанные секреты', 'Добудьте $1oa |4запертый контейнер:запертых контейнера:запертых контейнеров; в Обители ученых.', 'Кортия... Какие секреты она таит?\n\nМои помощники не покладая рук обследуют эти несчастные земли, разыскивая всякие любопытные вещицы. Ничего особенно важного, уверяю тебя.\n\nОни поместили свои находки в специальные ящики, которые следует забрать из Обители ученых. Не волнуйся: прочнейшие печати на этих ящиках защитят и содержимое, и курьера.\n\nПринеси мне запертые контейнеры, и я щедро тебя вознагражу.', '', '', '', '', '', '', 39653),
(63776, 'ruRU', 'Записи наблюдений', 'Принесите $1oa |4запись:записи:записей; наблюдений из Обители ученых.', 'Приветствую тебя, пилигрим Утробы. Не уделишь мне минутку?\n\nКак ты, наверное, уже знаешь, мой картель тайно разместил по всей Кортии наблюдательные устройства. Но мы не можем проанализировать данные, пока не соберем их. Я попрошу это сделать тебя.\n\nПриборы в Обители ученых уже должны были записать достаточно. Ты не увидишь сами устройства, но собранные данные появятся перед тобой в виде яркой сферы.\n\nНе забудь проверить в пещерах под землей!\n\nПринеси мне эту информацию, и я щедро тебе заплачу.', '', '', '', '', '', '', 39653),
(63775, 'ruRU', 'Криптограммы и ключи', 'Найдите у Хранилища и на Форуме Искателей $1oa |4украденную криптограмму:украденные криптограммы:украденных криптограмм;.', 'В хранилищах знаний Кортии установлено сразу несколько слоев защиты. И недаром.\n\nЧтобы раскодировать и отключить барьеры, к каждому нужно подобрать криптограмму. Можешь считать их ключами ко всем секретам.\n\nНесколько криптограмм уже бесследно пропало – они украдены Верными Утробе. Поищи вокруг Хранилища, найди криптограммы и верни мне. Я сберегу их, чтобы защитить секреты, которые они охраняют.', '', '', '', '', '', '', 39653),
(63774, 'ruRU', 'Груда трупов', 'Отведите $1oa |4бестелесную душу:бестелесные души:бестелесных душ; к штопальщицам авангарда, которые сошьют для них новые тела.', 'Оглянись, $p. Куда ни посмотри, повсюду груды трупов. Бестелесные души снова рвутся в бой.\n\nЭто наш шанс повернуть ситуацию в свою пользу.\n\nСобери бестелесные души на поле боя и отведи их к штопальщицам у груд трупов. Они быстренько состряпают для всех жаждущих новые тела!', '', '', '', '', '', 'Вернитесь к баронессе Дреке.', 39653),
(63773, 'ruRU', 'Какая такая армия?', 'Выберите защитника и уничтожьте $7oa |4бушуюшего раба:бушующих рабов:бушующих рабов; и $8oa |4разрушительного раба:разрушительных рабов:разрушительных рабов; Утробы.', 'Тюремщик приказал своим элитным войскам зайти к нам с тыла. Они ставят под угрозу всю нашу стратегию! \n\nМне нужно, чтобы ты и еще один доброволец расправились с вражеским отрядом. Тебе вызвались помочь добровольцы из всех пяти домов Малдраксуса, $n.\n\nВыбирай кого хочешь. Для них будет честью сражаться плечом к плечу с тобой.', '', '', '', '', '', 'Передайте вести об успехе баронессе Дреке.', 39653),
(63772, 'ruRU', 'Поддержка с воздуха', 'Помогите Артемеде и кириям у южных ворот цитадели Вечных Мук.', 'Кирии прибыли, чтобы помочь нам в бою. Они укрепили наш фланг и осаждают южные ворота цитадели Вечных Мук. \n\nНайди Артемеду и помоги им чем сможешь!', '', '', '', '', '', '', 39653),
(63764, 'ruRU', 'Захват небес', 'Летите с Даникой в обитель Одина в Небесной Цитадели.', 'Я скорблю по потерянным сестрам и больше всего на свете мечтаю отомстить за них. Но я знаю, что не устою против колдовства этой ведьмы с ее армией Верных Утробе.\n\nПрислушаемся к гласу разума и улетим отсюда.\n\nЯ ослабла в заточении, но еще способна унести тебя.\n\nПолетели, друг мой.', '', '', '', '', '', '', 39653),
(63763, 'ruRU', 'Это может быть кто угодно', 'Отнесите голову Азодия Болвару Фордрагону в Приют хранителя.', '<Голова повелителя ужаса Азодия еще не остыла. Его лицо искривилось в жуткой гримасе.\n\nНужно рассказать обитателям Приюта хранителя о похищении писаря судьбы.\n\nВерховный лорд Фордрагон тоже должен узнать про этого неизвестного врага.>', '', '', '', '', '', 'Отнесите голову Болвару Фордрагону в Приют хранителя.', 39653),
(63762, 'ruRU', 'Под иллюзией', 'Воспользуйтесь Сферой писаря судьбы, чтобы развеять иллюзию.', 'Писарь судьбы собрал все необходимое, чтобы создать в этом зале иллюзию. К счастью, мы можем развеять ее с помощью его же инструмента.\n\nКонечно, он обрадуется при виде спасителей.\n\nНе могу не поблагодарить тебя за неоценимую помощь. Без тебя у меня бы ни за что не получилось его найти.', '', '', '', '', '', '', 39653),
(63761, 'ruRU', 'Отложенная месть', 'Убейте $1oa |4пожирателя:пожирателей:пожирателей; в Святилище наставлений.', '<Кортийский защитник серьезно ранен. Слова даются ему с трудом.>\n\nПожиратели... Они... заполонили все святилище. Нас было... слишком мало.\n\nМое задание... не выполнено.\n\nПредназначение... я...\n\n<Защитник говорит все тише и наконец умолкает.>', '', '', '', '', '', '', 39653),
(63760, 'ruRU', 'Отголоски судьбы', 'Отправляйтесь в Святилище наставлений и вызовите резонанс Сферы писаря судьбы у алтарей.', 'Это место кишит пожирателями, но мы должны сосредоточиться на поисках писаря судьбы.\n\nОбычно служители оставляют в святилищах аниму как подношение.\n\nЕсли инструмент писаря почует, что его владелец недавно был рядом, он войдет в резонанс. Если повезет, мы сможем определить, куда он делся.', '', '', '', '', '', '', 39653),
(63759, 'ruRU', 'Перенаправление поиска', 'Встретьтесь со смотрительницей Ка-Тан в Кортии у входа в Святилище наставлений.', 'Думаю, писарь судьбы направлялся в Святилище наставлений. Это своеобразный храм служителей Кортии.\n\nНам очень повезло – благодаря твоей привычке подбирать всякий мусор у нас есть Сфера писаря!\n\nОна наверняка поможет нам отыскать его. Но сначала давай дойдем до Святилища.', '', '', '', '', '', 'Встретьтесь со смотрительницей Ка-Тан в Кортии у входа в Святилище наставлений.', 39653),
(63758, 'ruRU', 'Самое последнее место', 'Обыщите Форум Искателей и попытайтесь отыскать пропавшего писаря судьбы.', 'Я пришла сюда в поисках писаря судьбы или хотя бы какой-то зацепки.\n\nВсе указывает на то, что он был здесь и пережил нападение Верных Утробе. Я не заходила только в зал медитации с той стороны руин.\n\nВозвращаться на Форум Искателей в одиночку слишком опасно. Ты мне поможешь?\n\nЯ обязана найти писаря судьбы, это очень важно.', '', '', '', '', '', '', 39653),
(63757, 'ruRU', 'Грабь награбленное!', 'Добудьте $1oa |4кортийский артефакт:кортийских артефакта:кортийский артефактов; у Верных Утробе.', '<У Верного Утробе был при себе кортийский артефакт.\n\nЧто враги собирались с ним делать, совершенно непонятно. Наверняка служители Приюта хранителя будут рады возвращению своих реликвий.>', '', '', '', '', '', '', 39653),
(63756, 'ruRU', 'Спасение от мук', 'Спасите $1oa |4страдающего служителя:страдающих служителей:страдающих служителей; на Форуме Искателей.', 'Верные Утробе убивают не всех, кого находят на Форуме Искателей. Многих выживших они допрашивают.\n\nМы должны спасти всех, кого только можно. Вероятно, кто-то из них видел писаря судьбы.', '', '', '', '', '', '', 39653),
(63755, 'ruRU', 'Срочное дело', 'Поищите писаря судьбы из Кортии.', 'Пилигрим Утробы, у нас возникла чрезвычайная ситуация.\n\nНаш писарь судьбы пропал. Не дошел до Ро-Домама. Раньше его можно было найти на Форуме Искателей, до того как...\n\n<Путеписец Ро-Весс замолкает.>\n\nТы его поищешь? Многие служители прятались от Верных Утробе в пещерах рядом с руинами.', '', '', '', '', '', '', 39653),
(63754, 'ruRU', 'Птица в клетке', 'Добудьте у Кьеллрун кованую печать Хелии и выпустите Данику на свободу.', 'Ни звука! Не привлекай к нам внимания.\n\nМногие мои сестры уже погибли, и скоро меня тоже принесут в жертву в отвратительном ритуале этой ведьмы.\n\nВыпусти меня из клетки – я вызволю нас отсюда и предупрежу Одина о предательстве.\n\nПечать, которая может освободить меня, есть у Верной Утробе Кьеллрун. Она в соседнем зале – упивается нашими страданиями.', '', '', 'Кьеллрун Боронительница', '', '', '', 39653),
(63740, 'ruRU', 'Советы мастеров', 'Установите связь с мемориалами архивариусов.', 'Мы можем вернуть силу Посоху Притяжения, но для этого потребуется вся мудрость архивариусов.\n\nНе только моя, но и всех моих предшественников, захороненных неподалеку. Кортия наполовину разрушена, а оставшееся вряд ли долго простоит. Так что, скорее всего, у нас больше не будет возможности навестить их гробницы.\n\nПосети мемориалы архивариусов. Возьми с собой ученого Ро-Сюира – пусть он запишет знания, которые скоро будут утеряны.', '', '', '', '', '', '', 39653),
(63739, 'ruRU', 'Путь надежды', 'Найдите архивариуса Ро-Сенару и ученого Ро-Сюра у вершины Подъема надежды.', 'У нас осталось одно последнее дело.\n\nНайди меня на вершине Подъема надежды.', '', '', '', '', '', '', 39653);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(63738, 'ruRU', 'Контроль над архивом', 'Встретьтесь с ученым Ро-Сюиром в Приюте хранителя.', 'Я отправлюсь в Приют хранителя, где сравнительно безопасно.\n\nТам мы создадим новый архив.\n\nПриходи, когда сможешь.\n\nНадеюсь, ты нас не оставишь. Нам нужна твоя помощь.', '', '', '', '', '', '', 39653),
(63737, 'ruRU', 'Поиски истинного предназначения', 'Проведите ритуал и настройте Посох Притяжения.', 'Мы так близко от цели.\n\nМудрость архивариусов и небольшая помощь |3-1($r)-|3-1($c) поможет нам связать Посох притяжения с нужными реликвиями.\n\nЕсли все пройдет удачно, у нас будет все необходимое для восстановления архивов.\n\nТогда мы сможем вернуться к нашей священной миссии.', '', '', '', '', '', '', 39653),
(63736, 'ruRU', 'Вливание анимы', 'Зарядите Посох Притяжения анимой.', 'Обычно мы заряжаем посох энергией Звезды пустоты, еще одной могущественной реликвии.\n\nК сожалению, сейчас это невозможно. Но в крайнем случае эту энергию может заменить анима. В Кортии ее с избытком.\n\nВозьми посох и подержи его над свежими трупами пожирателей в эстуарии внизу.\n\nПосох вытянет и поглотит аниму.', '', '', '', '', '', '', 39653),
(63734, 'ruRU', 'Расколотый посох', 'Верните три части Посоха Притяжения.', 'Что ж, у меня нет выбора. Придется довериться тебе и рассказать о Посохе притяжения.\n\nВ нужных руках – например в руках опытного архивариуса – он помогает искать могущественные реликвии в царствах Темных Земель.\n\nЧтобы им не воспользовались со злым умыслом, мы разделили его на три части. Захватчики их нашли, но они понятия не имеют, что это.\n\nЧасти посоха забрали себе Верные Утробе. Найди их и добудь все.', '', '', '', '', '', '', 39653),
(63733, 'ruRU', 'Проложить путь', 'Убейте $1oa |4Верного Утробе захватчика:Верных Утробе захватчиков:Верных Утробе захватчиков;.', 'Я ненавижу насилие и предпочитаю решать конфликты мирным путем, но здесь иного пути нет.\n\nЧтобы мы с Ро-Сюиром могли бежать, тебе придется нанести удар Верным Утробе, заполонившим Форум Искателей.\n\nРасчисти путь, и мы наконец-то выберемся отсюда.', '', '', '', '', '', '', 39653),
(63732, 'ruRU', 'Прервать допрос', 'Спасите архивариуса Ро-Сенару.', 'Тс-с... тише!\n\nЕсли захватчики меня здесь увидят, то убьют. Как и всех остальных...\n\n<Отчаянными жестами Ро-Сюир показывает в сторону Верных Утробе.>\n\nОни пытают архивариуса!\n\nТы $gобязан:обязана; придумать, как спасти ее. Мы не можем допустить, чтобы ее знания попали им в руки!', '', 'Жестокость этого дознавателя вызывает отвращение.', 'Дознаватель Тзенч', '', '', '', 39653),
(63731, 'ruRU', 'Исследование кортийских реликвий', 'Найдите ученого Ро-Сюира и спросите о реликвиях.', '<Вы нашли разорванную книгу с описанием реликвий, которые хранились в Кортии.>\n\n<На страницах книги высвечивается имя: Ро-Сюир.>\n\n<Имя начинает пульсировать, а книга поворачивается у вас в руках и куда-то указывает.>\n\n<Может, этот Ро-Сюир объяснит, что за реликвии вы нашли.>', '', '', '', '', '', '', 39653),
(63728, 'ruRU', 'Охота среди домов', 'Разузнайте подробности у Изеры, а затем отыщите Хална Крутогора в Гробнице Знаний.', 'Мне снилось, что Тиранда Шелест Ветра может спасти Арденвельд.\n\nНочной народец уже давно ищет подобных ей Ночных Воительниц. Для этого мы заручились поддержкой древнего союзника из Азерота по имени Халн Крутогор.\n\nСила Элуны слишком велика для смертных – даже таких, как Тиранда. Не знаю, сколько еще она продержится.\n\nЯ все подробно тебе расскажу, а ты затем отправляйся к Халну в Малдраксус.', '', '', '', '', '', '', 39653),
(63727, 'ruRU', 'Возвращение Примаса', 'Поговорите с Примасом в Приюте хранителя и спланируйте следующую атаку.', 'Тюремщику нужно пять печатей, и четыре уже у него.\n\nКак глупо с его стороны оставить нас в живых. Он хочет сделать нас своими рабами, но это его погубит.\n\nЕще можно переломить ход борьбы – стоит только захотеть. У нас пока есть что ему противопоставить.\n\nИдем. Встретимся с оставшимися воинами и обсудим план следующей атаки.', '', '', '', '', '', 'Поговорите с Примасом в Кортии.', 39653),
(63726, 'ruRU', 'Освобождение печати', 'Поговорите с Болваром и обсудите, как поступить с печатью.', 'Печать Примаса скована магией воспоминаний. Это напоминает мне кое-что, с чем ты уже $gвстречался:встречалась; раньше.\n\nСреди твоих союзников – Резчик Рун, несчастная душа из глубокой темницы Торгаста. Он вплетал найденные тобой воспоминания в оружие и доспехи.\n\nБыть может, Резчик Рун сумеет распутать сети воспоминаний вокруг печати.\n\nЭто наш единственный способ сохранить печать. Хотя риск велик.', '', '', '', '', '', 'Поговорите с Примасом в Торгасте.', 39653),
(63725, 'ruRU', 'В Хранилище', 'Заберите печать Примаса из Хранилища Кортии.', 'Эти разрушения... тяжелое зрелище.\n\n<Тал-Галан шепотом произносит молитву.>\n\nАнима течет в разоренное Хранилище. Теперь мы сможем открыть проход.\n\nКогда попадем внутрь, я попробую отыскать печать Примаса. \n\nТолько прояви почтение, когда будем входить. Мало кто удостаивается чести увидеть это священное место.\n\nДаже в пророчествах нет ни слова о том, что когда-либо его секреты откроются живым смертным.', '', '', '', '', '', 'Принесите Печать Примаса Болвару Фордрагону в Кортию.', 39653),
(63722, 'ruRU', 'Хранители Кортии', 'Спасите трех хранителей записей в Хранилище тайн.', 'Мы едва отбиваем атаки войск Тюремщика. С тобой мы наконец-то сможем продвинуться вперед.\n\nЯ знаю, что тебе нужно в Хранилище, но сначала придется найти нескольких хранителей записей.\n\nОни многое знают о Хранилище. Эти знания не должны достаться Тюремщику.', '', '', '', '', '', 'Встретьтесь с секутором Мевиксом в Хранилище тайн.', 39653),
(63717, 'ruRU', 'Защита Хранилища', 'Помогите защитнице Ка-Рев победить Верных Утробе захватчиков.', 'Нам нужно проложить путь к Хранилищу через орды Верных Утробе.\n\nКовенанты всеми силами сдерживают их, но они не могут делать это вечно. Верные Утробе полны решимости присвоить трофей раньше тебя.\n\nПомоги нам оттеснить армию Тюремщика, пилигрим.\n\nДа укажет нам путь Предназначение.', '', '', '', '', '', 'Встретьтесь с секутором Мевиксом в Хранилище тайн.', 39653),
(63714, 'ruRU', 'Путь к Хранилищу', 'Доберитесь до Хранилища тайн на транспортном костекрыле.', 'Благодаря Гейрмир оба проводника восстановлены и анима наверняка уже потекла в хранилище. Теперь мы сможем в него войти – но сначала до него надо добраться.\n\nНаши союзники из Малдраксуса организовали транспорт отсюда до хранилища. Не будем терять времени.\n\nЕсли прислужники Тюремщика добудут печать Примаса раньше нас, пострадает не только Кортия. Падут все Темные Земли.\n\nИдем, пилигрим Утробы. Наши воины ждут.', '', '', '', '', '', 'Поговорите с защитницей Ка-Рев в Хранилище тайн.', 39653),
(63713, 'ruRU', 'Крючкотворство', 'Отправляйтесь на летающий остров с помощью костяного крюка и почините проводник анимы.', 'Я сделала крюкомет и крепления для него. Не волнуйся – раз они выдержали мой вес, выдержат и твой!\n\nКрюки перенесут нас через эту пропасть к следующему проводнику анимы.\n\nЯ пойду первая и подожду тебя. Кто знает, что там впереди.\n\nЧем раньше мы запустим проводник, тем скорее откроем хранилище и заберем печать Примаса.', '', '', '', '', '', '', 39653),
(63712, 'ruRU', 'Пропавшие записи', 'Найдите $2oa |4пропавшую запись:пропавшие записи:пропавших записей; с помощью матричного маячка.', 'Несколько хранителей записей бежали на эту гору, когда Кортию затянуло в Утробу.\n\nИх самих нигде не видно, но вполне вероятно, что записи где-то остались. \n\nВозьми этот маячок. Он изготовлен по инструкциям хранителей, которых ты $gспас:спасла; раньше.\n\nМаячок приведет тебя к уцелевшим записям на горе.', '', '', '', '', '', '', 39653),
(63711, 'ruRU', 'Костяные инструменты', 'Добудьте $1oa |4насыщенную анимой кость:насыщенные анимой кости:насыщенных анимой костей; у местных зверей.', 'И что, устройство для входа в хранилище находится на летающем острове?\n\nЕрунда.\n\nУ нас здесь полно выносливых существ. Я всегда говорила: каждой косточке найдется применение!\n\nПринеси мне кости этих существ. Я сделаю из них крепления для крюков, и мы доберемся до этого твоего острова.', '', '', '', '', '', '', 39653),
(63710, 'ruRU', 'След анимы', 'Идите по следу анимы к следующему проводнику.', 'Значит, Тюремщик охотится за печатью Примаса. Мы должны добраться до нее раньше Верных Утробе. Чтобы открыть хранилище, надо направить в него аниму.\n\nТы $gпомог:помогла; Костоплаву починить первый проводник. Иди по следу анимы, и он приведет тебя к следующему. \n\nЕсли мы его активируем, в хранилище поступит достаточно анимы, и путь откроется.\n\nИдем, у нас мало времени!', '', '', '', '', '', 'Встретьтесь с костоплавом Гейрмир и Тал-Галаном в конце следа анимы.', 39653),
(63709, 'ruRU', 'Тайны хранилища', 'Изучите найденные записи вместе с Тал-Галаном.', 'Какая удача! Ты $gспас:спасла; хранителей раньше, чем Верные Утробе успели выпытать у них информацию о реликвиях.\n\nМы знаем далеко не все, их записи уцелели лишь частично. Но я молюсь, чтобы оставшегося нам хватило!\n\nЯ попробую сопоставить обрывки сведений и прочитать скрытое в них послание. Если Предназначению будет угодно, мы узнаем, чего хочет Тюремщик и кому эта реликвия принадлежала раньше.\n\nМне нужно сосредоточиться на работе. Скажи мне, когда будешь $gготов:готова; начинать.', '', '', '', '', '', '', 39653),
(63708, 'ruRU', 'Фантазмагория', 'Принесите искаженную фантазму Ве\'нари в Убежище Ве\'нари.', '<Странная частица потусторонней энергии беспорядочно мерцает. \n\nМожет, она заинтересует Ве\'нари.>', '', '', '', '', '', '', 39653),
(63706, 'ruRU', 'Лейся, анима', 'Помогите костоплаву Гейрмир починить проводник анимы.', 'Тал-Галан ввел меня в курс дела и объяснил принцип работы хранилища. Во всяком случае, в меру своих сил – как чистый теоретик.\n\nДля начала нам нужно наладить в хранилище источник энергии. Анима должна поступать через подземные проводники.\n\nСмотритель говорит, что один из них спрятан в пещере под Обителью ученых.\n\nОтведи меня туда, и я его починю. Обеспечь прикрытие, пока я разбираюсь с их кортийскими устройствами.', '', '', '', '', '', '', 39653),
(63705, 'ruRU', 'Хранители знаний', 'Спасите $1oa |4хранителя:хранителей:хранителей; записей в Обители ученых.', 'Хранилище огромно, там веками копились секреты и артефакты. Даже если открыть его, мы вряд ли поймем, что именно ищет Тюремщик.\n\nНекоторые служители носят звание хранителей записей. Они ведут учет всех реликвий хранилища и будут беречь его тайны до последнего.\n\nВерные Утробе схватили нескольких хранителей и пытают их в надежде что-то выведать.\n\nСпаси хранителей, $n. От них мы узнаем, что нужно Тюремщику.', '', '', '', '', '', '', 39653),
(63704, 'ruRU', 'Месть за Кортию', 'Убейте $1oa |4Верного:Верных:Верных; Утробе в Обители ученых.', 'Проникнуть в хранилище – наша главная цель, но я хочу попросить об услуге.\n\nКогда Кортию затянуло в Утробу, мы были в ужасе. Многие попытались найти спасение в мирном убежище – Обители ученых. Вон она, прямо перед тобой.\n\nВскоре на нас напали Верные Утробе. Кого-то они убили, других взяли в плен.\n\nЯ бы сам отомстил им, если б мог. Но я... я не гожусь для битвы. В отличие от тебя.\n\nПрошу – покажи этим чудовищам, что осквернение Кортии не останется безнаказанным!', '', '', '', '', '', '', 39653),
(63703, 'ruRU', 'Хранилище тайн', 'Встретьтесь с Тал-Галаном у Обители ученых.', 'С твоей помощью мы хоть как-то восстановили здесь порядок, но наши шансы сохранить его невелики.\n\nСилы Тюремщика начали крупное наступление на разрушенное хранилище у границ Кортии. Изгнанник явно стремится добыть какую-то ценную реликвию.\n\nХранилище активировало защитные системы, поэтому попасть в него будет непросто. Но мы должны добраться до этой реликвии раньше Верных Утробе.\n\nЧтобы открыть хранилище, я позвал на помощь кое-кого из Малдраксуса.', '', '', '', '', '', 'Поговорите с Тал-Галаном у Обители ученых.', 39653),
(63683, 'ruRU', 'Печать Зимы', 'Принесите Слезу сестры Изере в Сердце леса.', 'Моя сестра... столько лет прошло... и она все равно не бросила меня...\n\n<На какую-то долю секунды лицо Королевы Зимы озаряет тень улыбки. Затем она снова обращает на вас взгляд, и вы чувствуете довлеющую над ней тяжесть веков.>\n\nПомоги мне, $n. Возьми слезу моей сестры, и приходи в Сердце леса.', '', '', '', '', '', '', 39653),
(63682, 'ruRU', 'Сила Элуны', 'Помогите провести ритуал.', 'Мы больше ничего не успеем за такое короткое время.\n\nТеперь нам остается только объединить силы с Тирнаксом и остальными. И надеяться, что Тиранда выживет.', '', '', '', '', '', '', 39653),
(63681, 'ruRU', 'В самое Сердце', 'Вернитесь к Изере в Сердце леса в Арденвельде.', 'Нам нужно как можно скорее возвращаться в Арденвельд!\n\nТы иди вперед и отыщи Изеру, а я отправлюсь вместе с Камнетворицей и прослежу за тем, чтобы с Халном все было в порядке.', '', '', '', '', '', 'Вернитесь к Изере в Сердце леса в Арденвельде.', 39653),
(63680, 'ruRU', 'На грани', 'Отыщите Хална Крутогора', 'Получается, Хална куда-то увели по приказу самой Камнетворицы!\n\nНадо поискать в округе ее следы. Может, по ним мы найдем Хална!', '', '', '', '', '', '', 39653),
(63679, 'ruRU', 'Загадочное волшебное путешествие!', 'Отыщите леди Лунную Ягоду в Ревендрете.', '<Из свитка раздается голос леди Лунной Ягоды.>\n\n$n! Похоже, Халн попал в переплет. Все... сложно. Нам очень нужна твоя помощь в Ревендрете! Пожалуйста, приходи в крепость Господства, я буду ждать.\n\nДо встречи!', '', '', '', '', '', 'Отыщите леди Лунную Ягоду в Ревендрете.', 39653),
(63678, 'ruRU', 'Месть за Акарека', 'Встретьтесь с маркграфиней Син\'дейн на \"Экзорамасе\" в доме Ритуалов.', 'Последний из предателей, причастных к падению маркграфа Акарека, мертв. \n\nМаркграфа этим не вернуть, но все равно приятно.\n\nБаронесса просила сообщить маркграфине Син\'дейн, что дело сделано, и только потом отправляться в Арденвельд.', '', '', '', '', '', 'Встретьтесь с маркграфиней Син\'дейн на \"Экзорамасе\" в доме Ритуалов.', 39653),
(63677, 'ruRU', 'Ты умрешь', 'Убейте Фал\'зинге на \"Экзорамасе\".', 'Последним в моем списке значится лич по имени Фал\'зинге.\n\nСин\'дейн давно за ним присматривает в надежде выведать следующие шаги Кел\'Тузада.\n\nОна хочет, чтобы его смерть была мучительной. \n\nЕго можно найти на \"Экзорамасе\", в доме Ритуалов.', '', 'Убейте Фал\'зинге.', 'Фал\'зинге', '', '', '', 39653),
(63676, 'ruRU', 'Тебе не спрятаться', 'Добудьте знаки расположения Кел\'Тузада и убейте Драва\'ору.', 'Несмотря на то, что Кел\'Тузад вышел из тени, некоторые продолжают скрывать свою связь с ним. Они приложили руку к падению моего маркграфа и должны умереть.\n\nМне известно лишь одно имя, Драва\'ора, но их гораздо больше. Маркграфиня Син\'дейн говорит, что предатели имеют при себе знаки расположения. Она не знает, кто конкретно ими отмечен, так что будем убивать, пока не разберемся.\n\nПусть это послужит уроком для остальных.', '', '', '', '', '', '', 39653),
(63675, 'ruRU', 'Тебе не уйти', 'Соберите улики, а затем убейте Зелмани.', 'Зелмани сыграл важную роль в падении моего маркграфа.\n\nСин\'дейн считает, что он хочет собрать войско из приспешников Кел\'Тузада и осуществить еще какой-то план.\n\nМы должны выяснить, где он скрывается, и уничтожить его.', '', '', '', '', '', '', 39653),
(63674, 'ruRU', 'С вашего позволения', 'Встретьтесь с леди Вайш у Престола Примаса и попросите помощи у Кхалик.', 'Баронесса Вайш поручила мне одно дело. Но мне нужна помощь – надо спросить ее, можно ли мне привлечь к этому тебя, а потом помочь тебе в твоих делах.\n\nОтправляйся к Престолу Примаса. Там мы с ней и поговорим.', '', '', '', '', '', '', 39653),
(63673, 'ruRU', 'Охота среди домов', 'Отыщите Хална Крутогора в Малдраксусе.', '$n! У меня хорошие новости. Благодаря сотрудничеству между ковенантами охота Хална была успешной. Ему удалось найти в Темных Землях еще двух Ночных Воительниц.\n\nОтправляйся к нему в Малдраксус, и он расскажет тебе о первой из них. Халн будет ждать в Гробнице Знаний.\n\nПоспеши, $n. Сила Элуны разрывает саму сущность Тиранды. Не знаю, сколько еще она продержится.', '', '', '', '', '', '', 39653),
(63672, 'ruRU', 'Мольба, идущая из Сердца', 'Встретьтесь с Изерой в Сердце леса.', '<Вы читаете послание, и оно звучит у вас в сознании голосом Изеры.>\n\n$n!\n\nМне нужна твоя помощь в одном исключительно важном деле. Пожалуйста, как можно скорее приходи в Сердце леса.', '', '', '', '', '', '', 39653),
(63669, 'ruRU', 'Да покормите уже Кевина!', 'Поглотите $1oa |4труп:трупа:трупов; врагов, чтобы вырастить Кевина.', 'Моя слизь всегда не против полакомиться новыми душами, а в этих трупах еще осталось порядочно анимы.\n\nЧем больше слизь ест, тем крупнее вырастает – и останки павших становятся частью нашей счастливой склизкой семьи!\n\nБери Кевина и корми его телами, пока не наестся. А когда он подрастет, мы спустим его на наших врагов!', '', '', '', '', '', 'Вернитесь к баронессе Дреке.', 39653),
(63665, 'ruRU', 'Открытие Орибоса', 'Активируйте путевой камень и отправляйтесь в Орибос.', 'Пророчество гласило, что однажды этот дремлющий путевой камень сослужит добрую службу пилигриму Утробы. И что именно это определит судьбу всех Темных Земель.\n\nЗначит, этот день настал.\n\nАктивируй путевой камень своей анимой – и им смогут пользоваться все твои союзники.\n\nЕсли Тал-Инара и правда создала в Орибосе якорь, то он приведет тебя обратно к нам.\n\nИди, $n. Сообщи всем, что Утроба ждет... и Кортии нужна ваша помощь.', '', '', '', '', '', 'Поговорите с Болваром Фордрагоном в Кольце Перенаправления.', 39653),
(63664, 'ruRU', 'На позицию!', 'Защитите передовую позицию в цитадели Вечных Мук.', 'Нашу позицию у моста, ведущего к Алтарю Господства, атакуют! Нельзя, чтобы враги уничтожили установленную там баллисту.\n\nЗащищай позицию до тех пор, пока наши войска не перейдут мост!', '', '', '', '', '', 'Вернитесь к баронессе Дреке.', 39653),
(63663, 'ruRU', 'Кортия, Город Тайн', 'Позвольте Ве\'нари просканировать область, а затем осмотрите то, что она вам укажет.', 'Мы в двух шагах от цели, пилигрим.\n\nТвой заветный путевой камень наверняка уже недалеко. Мои интересы, естественно, намного скромнее. Крупица полезных сведений, какой-нибудь бесценный артефакт...\n\nЯ просканирую область – вдруг здесь есть что-то стоящее... или опасное... а потом мы двинемся дальше.', '', '', '', '', '', 'Поговорите с Тал-Галаном у отключенного путевого камня.', 39653),
(63662, 'ruRU', 'Тайны Утробы', 'Отправляйтесь с Ве\'нари к новой области в Утробе.', 'Утроба меняется, смертная душа. А где перемены, там и новые возможности.\n\nТюремщик притянул в Утробу царство, которое было скрыто в глубинах Темных Земель. Оно представляет для меня определенный интерес, но я не хочу отправляться туда одна.\n\nПроблема в том, что там полно слуг Тюремщика. Видимо, они ищут что-то ценное.\n\nЯ знаю там безопасное место. Проводи меня туда, и я помогу тебе найти второй путевой камень.\n\nПо рукам?', '', '', '', '', '', 'Поговорите с Ве\'нари за пределами новой области.', 39653),
(63661, 'ruRU', 'Связь с Утробой', 'Спросите у Ве\'нари, где находится второй путевой камень.', 'Писарь судьбы говорит, что в Утробе недавно появился второй неактивный путевой камень. Ты $gдолжен:должна; его найти. \n\nЯ создам в Орибосе якорь и наполню его твоей анимой. Как только установишь связь с камнем, мой якорь тоже на него настроится.\n\nЕсли у тебя все получится, ковенанты смогут отправлять войска в Утробу и покидать ее тем же путем.\n\nПусти в ход любые доступные тебе средства, чтобы найти этот камень.\n\nУдачи, пилигрим. Да ведет нас всех Предназначение.', '', '', '', '', '', 'Поговорите с Ве\'нари в убежище Ве\'нари.', 39653),
(63660, 'ruRU', 'Доступ в Утробу', 'Позвольте Тал-Инаре изучить вашу аниму.', 'Еще одна печать теперь у Тюремщика, и его войско перешло к открытому штурму Орибоса.\n\nБолвар Фордрагон и малдраксийка Дрека предлагают нам самим начать наступление на Тюремщика.\n\nДля этого нам нужно придумать, как перебрасывать силы в Утробу и обратно.\n\nДо твоего появления мы считали, что это невозможно, но теперь надежда есть.\n\nПозволь мне взглянуть на твою аниму – по ней я пойму, не противоречит ли наш замысел Предназначению.', '', '', '', '', '', 'Поговорите с Тал-Инарой в Кольце Перенаправления.', 39653),
(63659, 'ruRU', 'Повелители ужаса!', 'Поговорите с Примасом в Кортии.', 'Это уже пятый лазутчик повелителей ужаса за эту неделю. Пока они здесь, нашему лагерю грозит серьезная опасность.\n\nПри жизни один охотник на демонов научил меня распознавать этих существ. Мне не составляет особого труда их находить, но я не могу быть во всех местах сразу.\n\nНужно доложить о ситуации Примасу.', '', '', '', '', '', 'Поговорите с Примасом в Кортии.', 39653),
(63656, 'ruRU', 'Дух гнева', 'Явитесь с докладом к Примасу.', 'Я немедленно соберу войска и отправлю несколько отрядов в Кортию. Я передам им устройства, созданные баронессой Вайш и Кель\'тасом для защиты от натрезимов-лазутчиков.\n\nПеред тем, как отправиться в Кортию, мне надо закончить другие дела. Надо убедиться, что в крепость Господства больше не пролезет ни один шпион.\n\nИ, я думаю, надо рассказать Примасу о том, что произошло. Скажи ему, что $gдобился:добилась; успеха.', '', '', '', '', '', 'Явитесь с докладом к Примасу.', 39653),
(63655, 'ruRU', 'Медальон Гнева', 'Отнесите медальон Гнева на помост в Грехопаде.', 'Пилигрим, вместе с моими камнерожденными я спущусь во тьму Утробы и поотрываю головы всем натрезимам!\n\nОднако Ревендрет должен осторожно просчитывать свои шаги в этой войне. Нельзя проиграть ее из-за взыгравшего высокомерия.\n\nПоэтому как Жнец гнева, вторая носительница этого титула, я передаю свой медальон тебе на хранение. Разрешаю пользоваться им, пока я веду войну.\n\nДелись его силой со Жнецами, чтобы вместе сдерживать Денатрия – иначе он одним щелчком пальцев вернет себе власть над Ревендретом.', '', '', '', '', '', 'Отнесите медальон Гнева на помост в Грехопаде.', 39653),
(63654, 'ruRU', 'Натрезимы', 'Заберите Медальон Гнева у натрезимов.', 'Медальон Гнева – не просто мощный артефакт. С ним натрезимы смогут преобразовать это царство в своих темных целях. Более того, пока медальон у них, нам не удастся создать новую печать.\n\nИх козни уже чуть не уничтожили Пепельный Предел. Я не допущу, чтобы мой медальон использовали подобным образом.\n\nИдем. Надо его вернуть.', '', '', '', '', '', 'Поговорите с принцем Ренаталом в цитадели Рассвета.', 39653),
(63653, 'ruRU', 'Сила короны', 'Идите по тропе, ведущей к медальону Гнева.', 'Мы готовы.\n\nС помощью медальонов, которыми уже располагает Двор Жнецов, можно найти медальон Гнева. Покуда медальон остается в нашем царстве, мы можем определить его местонахождение.\n\nОднако этот ритуал довольно непрост – натрезимы как никто иной умеют скрываться. Как только увидишь тропу, сразу следуй по ней.\n\nНе нападай, когда окажешься у цели. Сначала дождись нас.', '', '', '', '', '', 'Поговорите с Камнетворицей в цитадели Рассвета.', 39653),
(63652, 'ruRU', '\"Незваные\" гости', 'Убейте $1oa |4натрезима:натрезимов:натрезимов; в Грехопаде.', 'Келра, то есть Нал\'рагас, не работала в одиночку. Предположим худшее: не все наши друзья и союзники – те, за кого себя выдают.\n\nДвор Жнецов нескоро сможет провести ритуал обнаружения. Начав действовать раньше времени, мы себя выдадим. Повтори в Грехопаде то, что ты $gсделал:сделала; у врат Господства, чтобы выявить натрезимов в наших рядах. \n\nДоброй охоты.', '', '', '', '', '', '', 39653),
(63651, 'ruRU', 'Криптограммы', 'Запишите $1oa |4инфернальную криптограмму:инфернальные криптограммы:инфернальных криптограмм;.', 'Раз натрезимы проникли в Грехопад, они должны как-то общаться между собой – и не только посредством жестов или речи. Они обмениваются магическими посланиями, скрывая их наложением простых чар.\n\nНо составленное мной заклинание поможет тебе увидеть эти послания.\n\nОтыщи зашифрованные сообщения и принеси мне. Если ты не сможешь понять, что в них написано, я тебе переведу.', '', '', '', '', '', '', 39653),
(63650, 'ruRU', 'Раз-проникновение', 'Встретьтесь с принцем Ренаталом в Грехопаде.', 'Мал\'Ганис.\n\nЯ много веков не произносил это имя. И вот теперь нам предстоит охота на него.\n\nЕсли медальон Гнева по-прежнему у него, ему не спрятаться. Мы отыщем его с помощью других медальонов.\n\nСобери охотников за повелителями ужаса и приходи ко мне в Грехопад. Работы хватит на всех.', '', '', '', '', '', '', 39653),
(63649, 'ruRU', 'Шпионские войны', 'Выследите и победите $1oa |4повелителя ужаса - лазутчика:повелителей ужаса - лазутчиков:повелителей ужаса - лазутчиков;.', 'Натрезимы. Повелители ужаса. Незримые гости.\n\nМожешь называть их как угодно. Они лучшие шпионы и лазутчики в любой из когда-либо существовавших реальностей. \n\nНо когда они вторглись к нам, то не учли три аспекта: Кель\'таса Солнечного Скитальца, баронессу Вайш и тебя, $n!\n\nСо мной инструмент, с помощью которого мы с Кель\'тасом распознавали натрезимов, еще когда служили Иллидану. А я к тому же глава дома шпионов!\n\nДавай-ка поймаем этих лазутчиков.', '', '', '', '', '', '', 39653),
(63648, 'ruRU', 'Нал\'рагас', 'Выследите и победите Нал\'рагас.', 'Медальон Камнетворицы нельзя оставлять в лапах натрезимов. \n\nОбвинительница объясняла, что медальон нам потребуется для создания новой печати вентиров. Потому-то Нал\'рагас со своими пособниками и устроила засаду сейчас.\n\nНо магия медальонов прямолинейна, и эффект, который они оказывают на наш мир, легко отследить. Давай догоним Нал\'рагас и убьем ее, пока она не получила подкрепление.', '', 'Опытная шпионка натрезимов.', 'Нал\'рагас', '', '', 'Поговорите с принцем Ренаталом.', 39653),
(63647, 'ruRU', 'Незримые гости', 'Помогите Камнетворице как можно больше узнать о посланнице.', 'Повелители ужаса.\n\nНу конечно же. Разумеется, они наконец решили вернуться. Я так и думала, что они явятся во время засухи. \n\nКогда я впервые тебя увидела, то решила, что ты можешь быть $gодним:одной; из них. С тех пор как они бежали из Ревендрета, прошло много эпох. Они поумнели... \n\nНо недостаточно. Будем надеяться, что недостаточно.\n\nИдем, пилигрим. Только тихо. Держи оружие наготове. Посланница, которая прибыла с тобой, не так дружелюбна, как тебе кажется.', '', '', '', '', '', '', 39653),
(63646, 'ruRU', 'Путь ковенантов', 'Соберите посланников и отправляйтесь к Вратам Господства.', 'Чтобы выковать печать вентиров заново, понадобятся все семь медальонов.\n\nПримас был прав. Нам нужна Камнетворица. Ее обидами на незримых гостей можно заполнить целую библиотеку, и ей принадлежит последний медальон. Нам давно следовало уговорить ее присоединиться к нашей армии.\n\nЯ все устрою. На этот раз все будет обставлено как положено: дипломатия, дары, вот это все. \n\nДоговорись с Келрой, она подготовит сопровождение.', '', '', '', '', '', 'Доставьте послание Примаса Камнетворице.', 39653),
(63645, 'ruRU', 'Узник цитадели Рассвета', 'Выслушайте рассказ принца Ренатала о судьбе сира Денатрия.', 'А, ты же еще не знаешь.\n\nМы его поймали. Сир Денатрий, владыка Ревендрета, заключен в своем собственном клинке.\n\nМы сразились с ним во время одного из рейдов на замок Нафрия.\n\nМы долго к этому готовились. Наши герои проявили невиданную отвагу и смекалку. На это ушла прорва денег. И, если честно, это было просто чудо.\n\nТеперь искупителя самого ждет искупление. Если хочешь, я могу рассказать тебе подробнее.', '', '', '', '', '', '', 39653),
(63644, 'ruRU', 'Жуткие вести', 'Поговорите с принцем Ренаталом в цитадели Рассвета в Ревендрете.', 'Не стоит недооценивать угрозу, которую натрезимы представляют для наших войск. Они хитры – так же хитры, как самые опытные ветераны дома Глаз. И мы не знаем, что они замышляют.\n\nСреди вентиров живет та, чей гнев на многие тысячи лет изгнал натрезимов из Темных Земель. \n\nЯ прошу тебя отправиться в Грехопад, отыскать там принца Ренатала и передать ему эту депешу. С тобой поедет баронесса Вайш, одна из моих шпионок. Ее опыт борьбы с натрезимами тебе пригодится.', '', '', '', '', '', 'Поговорите с принцем Ренаталом в цитадели Рассвета.', 39653),
(63639, 'ruRU', 'Доклад в Орибос', 'Вернитесь к Тал-Инаре в Орибос.', 'Арденвельд выстоял под напором армий Утробы.\n\nНо и этого еще недостаточно.\n\nВозвращайся к нашим союзникам в Орибос. Кто-то должен ответить за понесенные потери. Мы должны что-то предпринять.', '', '', '', '', '', 'Вернитесь к Тал-Инаре в Орибос.', 39653),
(63638, 'ruRU', 'Не отступать и не сдаваться', 'Проведайте Королеву Зимы.', 'Мы разобрались с Сильваной и ее Верными Утробе... пока что.\n\nНо нам нужно немедленно взять под охрану печать Королевы.\n\nКоролева сейчас неподалеку от Сердца леса, защищает украденные дикие семена от слуг Утробы.', '', '', '', '', '', '', 39653),
(63625, 'ruRU', 'Бери топор и в бой!', 'Убейте $1oa |4Верного Утробе бойца:Верных Утробе бойцов:Верных Утробе бойцов; и командира Малламорта.', 'Наши войска встретили серьезное сопротивление! Пилигрим Утробы! Хватай оружие и отправляйся в бой!\n\nИзбавься от защищающих ворота Верных Утробе и их командира.', '', '', 'Командир Малламорт', '', '', 'Передайте вести об успехе баронессе Дреке.', 39653),
(63624, 'ruRU', 'Наши пути', 'Поприсутствуйте на церемонии посвящения Дреки.', 'Армии Малдраксуса сильны. Они восстановятся после предательства Вираза. \n\nНо сначала мы должны возродить Малдраксус. Ты узришь новую эру в нашей истории, пилигрим!', '', '', '', '', '', '', 39653),
(63623, 'ruRU', 'Пустующий престол', 'Вернитесь к Престолу Примаса.', 'Пилигрим!\n\nВ мое долгое отсутствие ты $gпомогал:помогала; навести порядок в Малдраксусе и восстановить его силу. Я хочу тебя отблагодарить – ты будешь $gсвидетелем:свидетельницей; важной церемонии.\n\nВозвращайся в Малдраксус к моему престолу. Пора вознаградить одного из самых преданных моих соратников.', '', '', '', '', '', 'Поговорите с Примасом у Престола Примаса.', 39653),
(63622, 'ruRU', 'Победа нашего дела', 'Вернитесь к Примасу в Кортию.', 'Разделавшись с Хелией и Виразом, мы одержали важную победу над Верными Утробе и показали, на что способны объединенные силы Темных Земель!\n\nПора возвращаться в Кортию, пока еще что-нибудь не случилось.', '', '', '', '', '', '', 39653),
(63621, 'ruRU', 'Потянуть за цепь', 'Убейте Хранителя цепей.', 'Его называют Хранителем цепей, и глупо было бы его недооценивать. Он собирает местные души и готовится напасть на нас.\n\nИзбавься от Хранителя, пока он не пошел в атаку, пилигрим Утробы.', '', 'Его цепи лишают души собственной воли.', 'Хранитель цепей', '', '', '', 39653),
(63620, 'ruRU', 'Удел предателя', 'Убейте Вираза.', 'С тех пор как Вираз нас предал, от него одни неприятности. Мой долг как баронессы дома Избранных – лично проследить за тем, чтобы от этой угрозы не осталось и следа... а покойный маркрграф Крексус был отомщен.\n\nКак говорит Примас, мы должны отрубить голову этой змеи.\n\nИ сейчас самое время это сделать.', '', 'Этому предателю осталось недолго.', 'Барон Вираз', '', '', '', 39653),
(63619, 'ruRU', 'Расколотые и позабытые', 'Освободите $1oa |4пленного раскольника:пленных раскольников:пленных раскольников;.', 'Стой... Я тебя знаю! Пилигрим Утробы!\n\nМои братья и сестры пали жертвами порчи. Одни добровольно приняли от Хелии ее силу, другие воспротивились. Но теперь нас всех хотят подчинить ее воле.\n\nКогда начался бой, мне удалось уйти, но оставшихся раскольников по-прежнему заставляют проходить чудовищные ритуалы.\n\nПрошу тебя, освободи их. Когда вернемся в Бастион, мы готовы предстать перед судом Архонта и принять любое ее решение.', '', '', '', '', '', '', 39653),
(63618, 'ruRU', 'Любимое дело малдраксийцев', 'Убейте $1oa |4Верного:Верных:Верных; Утробе в Верхнем Дезмотероне.', 'Чем больше врагов мы здесь уничтожим, тем меньше придется на долю солдат. Ох, не скоро они забудут об истинной цели Малдраксуса. Покажи им, что случается с теми, кто угрожает безопасности Темных Земель.\n\nУбивай всех Верных Утробе на своем пути. Не щади никого.', '', '', '', '', '', '', 39653),
(63617, 'ruRU', 'Избавление от оков', 'Убейте Железного хранителя Салрикса.', 'Из-за хаоса на поле боя ворота в верхней части цитадели остались без охраны. Если мы проскользнем через них, скорее всего, этого никто не заметит.\n\nМежду нами и Хельгардом стоит лишь один из приспешников Хелии. Убей его.', '', 'Этот поработитель ведет Верных Утробе в Дезмотероне против армии ковенантов.', 'Железный хранитель Салрикс', '', '', '', 39653),
(63616, 'ruRU', 'Отличная работа', 'Подайте сигнал \"Зерекриссу\" и вступайте в бой.', 'Теперь можно идти в атаку.\n\nПодай сигнал \"Зерекриссу\". Покажем им всю мощь малдраксийского некрополя и объединенной армии Темных Земель!', '', '', '', '', '', '', 39653),
(63615, 'ruRU', 'Подрезать крылья', 'Убейте $1oa |4Верного Хелии душегуба:Верных Хелии душегубов:Верных Хелии душегубов; с помощью цепей Верных Утробе.', 'В небесах полно приспешников Хелии. Если от них не избавиться, \"Зерекриссу\" и нашим крылатым союзникам будет сложно к нам пробиться.\n\nЯ заметила, что многие Верные Утробе вооружены магическими цепями. Мы можем обернуть это оружие против них и свергнуть врага с небес.', '', '', '', '', '', '', 39653),
(63614, 'ruRU', 'С оружием в руках', 'Найдите Дра\'гору, топор Тралла.', 'Одну минуту, $n.\n\nКогда мы с Хелией встретились в Утробе в последний раз, я метнул в нее свой топор Дра\'гору – и с тех пор его больше не видел. Если это и в самом деле ее вотчина, то Дра\'гора наверняка где-то здесь.\n\nЯ выковал этот топор в Награнде, и он напоминает мне о той счастливой жизни вместе со своей семьей. Я хочу снова ощутить в руках его тяжесть.', '', '', '', '', '', '', 39653),
(63613, 'ruRU', 'Врата проклятых', 'Откройте $1oa |4врата:врат:врат; смерти.', 'Прежде чем подавать сигнал \"Зерекриссу\", нам нужно как следует все подготовить. После этого наши союзники наводнят территорию через врата смерти.\n\nИх надо будет открыть с этой стороны. Найди для них стратегические позиции.', '', '', '', '', '', '', 39653),
(63612, 'ruRU', 'Цепочка командования', 'Встретьтесь с Дрекой у Дезмотерона.', 'Чтобы удержать позицию на границе владений Тюремщика, нужно подстраховаться.\n\nВираз и Хелия укрылись в стенах Дезмотерона. Иллюзия безопасности сделала их беспечными, и мы должны использовать представившуюся возможность.\n\nМы застанем их врасплох. Бей быстро и безжалостно – и тогда, возможно, нам удастся срубить головы этих змей.', '', '', '', '', '', 'Поговорите с Дрекой у Дезмотерона.', 39653),
(63608, 'ruRU', 'Душа бегемота', 'Отнесите дух бегемота леди Муун в Сердце леса.', '<Дух бегемота свиреп. Теперь вы можете обращаться в бегемота.>', '', '', '', '', '', 'Отнесите дух бегемота леди Муун в Сердце леса.', 39653),
(63607, 'ruRU', 'Душа дикорога', 'Отнесите дух дикорога леди Муун в Сердце леса.', '<Дух дикорога яростен и напорист. Теперь вы можете обращаться в дикорога.>', '', '', '', '', '', 'Отнесите дух дикорога леди Муун в Сердце леса.', 39653),
(63606, 'ruRU', 'Душа паука', 'Отнесите дух паука леди Муун в Сердце леса.', '<Дух паука проворен и хитер. Теперь вы можете обращаться в паука.>', '', '', '', '', '', 'Отнесите дух паука леди Муун в Сердце леса.', 39653),
(63605, 'ruRU', 'Душа завролиска', 'Отнесите дух завролиска леди Муун в Сердце леса.', '<Дух завролиска ловок и сообразителен. Теперь вы можете обращаться в завролиска.>', '', '', '', '', '', 'Отнесите дух завролиска леди Муун в Сердце леса.', 39653),
(63603, 'ruRU', 'Душа яка', 'Отнесите дух яка леди Муун в Сердце леса.', '<Дух яка дружелюбен и вынослив. Теперь вы можете обращаться в яка.>', '', '', '', '', '', 'Отнесите дух яка леди Муун в Сердце леса.', 39653),
(63594, 'ruRU', 'Зачистка стен', 'С помощью перегруженного защитника уничтожьте $1oa |4угасший пилон:угасших пилона:угасших пилонов; на стенах цитадели Вечных Мук.', '<В свитке отмечено местоположение нескольких пилонов, защищающих цитадель Вечных Мук.\n\nЕсли уничтожить их, это поможет нашим войскам, атакующим цитадель.>', '', '', '', '', '', 'Вернитесь к Миканикосу.', 39653),
(63593, 'ruRU', 'Новая печать кирий', 'Вернитесь к Примасу в Кортию.', 'Бастион ожидает эпоха единства и верности, и восстановление печати ознаменует наше новое будущее.\n\nРасскажи Примасу обо всем, что ты $gсделал:сделала;. Как только он разрешит, мы отнесем печать ему.\n\nБудем надеяться, что с ней он сможет противостоять Тюремщику и спасет Темные Земли.', '', '', '', '', '', 'Вернитесь к Примасу в Кортию.', 39653),
(63592, 'ruRU', 'Новый путь', 'Поговорите с Калисфеной, чтобы принять участие в церемонии у престола Архонта.', 'Сегодня мы поприветствуем нового идеала. Впервые с незапамятных времен мы заново освящаем храм, чтобы увековечить нашу преданность друг другу.\n\nНовый идеал, новая печать и новый путь для всех кирий.\n\nЭта церемония войдет в легенды!', '', '', '', '', '', 'Поговорите с Адрестом, идеалом Преданности.', 39653),
(63591, 'ruRU', 'Почетный прием', 'Поговорите с Калисфеной, чтобы поучаствовать в собрании, затем побеседуйте со своими медиумами и прочими кириями.', '$n, ты $gпомог:помогла; кириям в самые тяжелые для нас времена. Благодаря твоей поддержке мы смогли начать все с чистого листа.\n\nОкажи нам честь и поучаствуй в собрании перед церемонией. Многие члены нашего ковенанта хотят поблагодарить тебя за верность.\n\nНастал великий, радостный день. Я с удовольствием приглашаю тебя отпраздновать его с нами.', '', '', '', '', '', 'Поговорите с Калисфеной у Источника Преданности.', 39653),
(63590, 'ruRU', 'Колокольный звон', 'Защищайте полемарха Адреста, пока он обновляет храм Верности.', 'Отныне верность не будет считаться главным требованием пути. Если мы достойны верности, претенденты обретут ее сами. Это будет их выбор.\n\nА мы должны поддерживать всех, кто в нас нуждается, будь то недавно прибывшие души или собратья, с которыми приключилась беда.\n\nНам потребуются все запасы анимы, чтобы посвятить этот храм новой цели и положить начало новой эры.\n\nБоюсь, что Верные Утробе попытаются сорвать наши планы. Защити меня во время ритуала, $n. Мы должны довести дело до конца.', '', '', '', '', '', '', 39653),
(63589, 'ruRU', 'Нацеленная решимость', 'Направьте аниму из цитадели в храм Верности.', 'Пять храмов Бастиона оставались неизменными с самого создания Бастиона. Подобная перемена станет для нас чем-то совершенно новым и потребует огромного количества анимы.\n\nПод этим храмом находятся запасы анимы, которые мы хранили, чтобы пережить засуху. Теперь анима возвращается к нам, и эти запасы можно направить на другую цель.\n\nИспользуй находящиеся там передатчики и экстракторы, чтобы направить аниму наверх. Это даст мне необходимую энергию.', '', '', '', '', '', '', 39653),
(63588, 'ruRU', 'Возрождение веры', 'Убедите $1oa |4раскольника:раскольников:раскольников; вновь ступить на путь кирий.', 'Раскольники не находят себе места, $n.\n\nОни скитаются по храму Верности, словно забытые призраки. Им просто некуда идти. У них больше нет лидера, указывающего цель.\n\nМы должны дать им надежду на будущее.\n\nЯ пойду в храм с тобой. Позволь мне поговорить с ними. Я знаю, что они сейчас чувствуют. Быть может, выслушав нас, они захотят следовать новому пути Адреста.', '', '', '', '', '', '', 39653),
(63587, 'ruRU', 'Возвращение анимы', 'Добудьте $1oa |4тронутое порчей ядро центуриона:тронутых порчей ядра центурионов:тронутых порчей ядер центурионов; у центурионов раскольников.', 'Послушай, $n. Миканикос многое рассказал мне о центурионах раскольников.\n\nКонечно, я поняла далеко не все, но, похоже, ему пока не удается привести их в удовлетворительное состояние.\n\nЗато нам может пригодиться их анима!\n\nАдрест так поглощен обновлением храма, что совсем о себе не думает. Я боюсь, как бы он не истратил всю свою аниму.\n\nЕсли тебе удастся добыть ядра этих центурионов, мы сможем подготовить резерв для Адреста.', '', '', '', '', '', '', 39653),
(63586, 'ruRU', 'Сострадание и преданность', 'Встретьтесь с Адрестом в Покое распорядителей.', 'Первым делом нам нужно перестроить храм Верности.\n\nПелагий предложил остаться и подготовить церемонию. Я вызвал Николона и его союзников в Покой распорядителей. Вместе мы поведаем раскольникам суть нашего нового пути. Быть может, кто-то из них захочет на него ступить.\n\nОтправляйся туда, как только сможешь.', '', '', '', '', '', 'Встретьтесь с Адрестом в Покое распорядителей.', 39653),
(63585, 'ruRU', 'Слепая верность', 'Сопроводите полемарха Адреста в Элизийскую цитадель на аудиенцию с Архонтом.', 'Теперь я ясно вижу, каким должно быть будущее кирий.\n\nИ сначала я должен обсудить это с Николоном. Прошу, останься и выслушай нас.\n\nПотом мы вернемся в Элизийскую цитадель.\n\nПредстоит важный разговор с Архонтом, и мне понадобится поддержка.', '', '', '', '', '', '', 39653),
(63584, 'ruRU', 'Триумфальное возвращение', 'Встретьтесь с Калисфеной в Элизийской цитадели.\n\nКирия-курьер доставит вас туда.', 'Этот храм станет символом нового будущего Бастиона, $n.\n\nХрам Преданности воплотит наше единство. Вместе с раскольниками, претендентами и кириями из разных миров мы создадим будущее, которым сможем гордиться.\n\nВернемся же в Элизийскую цитадель. Я хочу, чтобы ты $gприсутствовал:присутствовала; на этом знаменательном событии: назначении нового идеала и создании новой печати.', '', '', '', '', '', 'Встретьтесь с Калисфеной в Элизийской цитадели.', 39653),
(63583, 'ruRU', 'Я собираюсь жить вечно', 'Помогите Утеру вновь пережить последнее воспоминание.', '$n! Прошу тебя. Я еще не закончил.\n\nМне нужно узреть еще одно воспоминание. Еще одно тяжелое бремя.\n\nЭто... будет нелегко. Мне понадобится вся твоя поддержка.\n\nНо это необходимо.', '', '', '', '', '', '', 39653),
(63582, 'ruRU', 'Он был моим учеником', 'Помогите Утеру вновь пережить второе воспоминание.', 'Мысли об Артасе не дают Утеру покоя. Именно из-за него раскололась душа Утера, именно из-за него пала Девия.\n\nЯ ощущаю исходящую от этих воспоминаний боль.\n\nНужно копнуть глубже. Утеру нужно лицом к лицу встретиться с источником тьмы.\n\nТебе снова придется побывать в его прошлом ради его будущего.', '', '', '', '', '', '', 39653),
(63581, 'ruRU', 'Шаг в круг Света', 'Используйте зеркало души, чтобы помочь Утеру вновь пережить прошлое.', 'Именно этого я и боялся.\n\nКлинок скорби, сразивший Утера, повредил этот фрагмент души и исказил находящиеся в нем воспоминания.\n\nЧтобы оставить позади боль и тоску, Утер должен вновь пережить все это.\n\nИ при этом не в одиночестве.\n\nС моим зеркалом души Утер сможет встретиться с воспоминаниями и справиться с заключенными в них эмоциями. Мы поможем ему распознать искажения и понять правду.', '', '', '', '', '', '', 39653),
(63580, 'ruRU', 'Болезненные воспоминания', 'Помогите Утеру установить связь с фрагментом правосудия.', 'Появление раненой души Утера в Темных Землях стало причиной множества событий, которые привели к тому, что мы имеем сейчас.\n\nНедоверие Девии. Ее связь с Хелией. Появление раскольников.\n\nБастиону требуются перемены, но мы понятия не имеем, что предпринять.\n\nВозможно, ответы найдутся в этом фрагменте души Утера.', '', '', '', '', '', '', 39653),
(63579, 'ruRU', 'Душа паладина', 'Добудьте фрагмент правосудия в Оссуарии Изгнанника в Торгасте.', 'Болвару являлись видения о хранилище в глубинах Торгаста, где Тюремщик держит особенно ценные для него души.\n\nУтера убил клинок скорби. Это оружие разит с такой яростью, что разрывают душу на части.\n\nЕсли часть души Утера у Тюремщика, то его рана не исцелится, пока мы не объединим все фрагменты.\n\nОтнеси этот настроенный осколок в Торгаст, $p. Он укажет тебе путь к хранилищу.\n\nНайди потерянный фрагмент, чтобы душа Утера вновь стала цельной.', '', '', '', '', '', 'Встретьтесь с Тениосом в Храме Мудрости в Бастионе.', 39653),
(63578, 'ruRU', 'Битва за Арденвельд', 'Защитите печать Королевы Зимы в битве за Арденвельд.', 'Сир Денатрий нас предал, от Примаса из Малдраксуса нет никаких вестей, так что, думаю, можно предположить, что следующей целью Тюремщика станет Королева Зимы.\n\nМы не отдадим ее печать без боя!\n\nАрденвельду через многое пришлось пройти, но в нем кроется великая сила. Многие вещи здесь – не то, чем они кажутся.\n\nИ это нам поможет. Пусть приходят, мы защитим королеву!', '', '', '', '', '', '', 39653),
(63576, 'ruRU', 'Первый удар', 'Поговорите с полемархом Адрестом в Орибосе.', 'Ковенанты объединились, чтобы вместе защищать Темные Земли, но Тюремщик тоже не терял времени зря. Скоро он приступит к следующей части своего плана.\n\nПолемарх Адрест принес нам из Элизийской цитадели тревожные вести.\n\nПоспеши. Боюсь, наше время на исходе.', '', '', '', '', '', '', 39653),
(63545, 'ruRU', 'Разработка плана', 'Принесите Миканикосу $2oa |4деталь:детали:деталей; центуриона и $1oa |4болт:болта:болтов; автоматона.', 'Пока малдраксийцы штурмуют главные ворота, мы сосредоточимся на боковых, и в этом нам помогут центурионы.\n\nВ этой области полно обломков оскверненных центурионов, захваченных Тюремщиком. Из их деталей можно сделать новых, и они помогут нам в бою.\n\nПопробуй найти столько деталей, чтобы хватило на нового центуриона.', '', '', '', '', '', '', 39653),
(63543, 'ruRU', 'Атака некролордов', 'Завершите $1oa |4задание:задания:заданий; в цитадели Вечных Мук и Лике Забвения.', 'Нам удалось застать силы Тюремщика врасплох. Мы захватим цитадель Вечных Мук и разделаемся с ее защитниками у Алтаря Господства!\n\nНам очень нужна твоя помощь, пилигрим Утробы. Помоги нашим войскам в бою!', '', '', '', '', '', '', 39653),
(63435, 'ruRU', 'Битва в храме', 'Победите Антею в битве питомцев.', 'Мои родители защищают Святилище... восьми... кокосов? Я не слушала. Наверное, потому они меня тут и оставили.\n\nОни сказали, чтобы я тренировалась с большим белым котом! Я стану ниндзя!\n\n<Антея делает несколько ударов в вашем направлении.>\n\nЙа! Кия! Берегись!\n\n...\n\nМне скучно. Давай устроим битву питомцев? Я взяла с собой своих самых любимых.', '', '', '', '', '', '', 39653),
(62917, 'ruRU', 'Общие души', 'Встретьтесь с Обвинительницей у Горнила Уз.', 'Сила Жнецов наполняет твое смертное тело. Но она возрастет многократно, если связать твою душу с другой душой. \n\nЭта связь не навредит тебе, а напротив, даст обеим душам много преимуществ.\n\nОбвинительница проследит за тем, чтобы все прошло как надо. Найди ее у Горнила Уз, когда будешь $gготов:готова;.', '', '', '', '', '', '', 39653),
(62852, 'ruRU', 'Идеал Дикой Охоты', 'Поговорите с Айтлин в Сердце леса.', 'Рада встрече, $n!\n\nТеперь никто в Арденвельде в тебе не сомневается. Мы хотим снова наградить тебя за храбрость и изобретательность, которые ты $gпроявил:проявила; ради нас.\n\nВстретимся в Сердце леса.', '', '', '', '', '', '', 39653),
(62851, 'ruRU', 'Идеал Неумирающей армии', 'Поговорите с Налкорном Талсеном в Театре Боли.', 'Твоя непрестанная поддержка Неумирающей армии вызывает уважение наших бойцов. \n\nМне поручили передать тебе в знак благодарности часть недавних военных трофеев. Жду тебя у Престола Примаса, где ты сможешь их забрать.', '', '', '', '', '', '', 39653),
(62849, 'ruRU', 'Идеал Двора Жнецов', 'Поговорите с госпожой Михаэлой в Темном Приюте.', 'Пилигрим Утробы. \n\nБлагодаря тебе Двор Жнецов получил преимущество в войне с фанатиками и подхалимами, которые еще надеются на победу сира Денатрия.\n\nЕсли ты навестишь меня в Темном Приюте, я передам тебе свою благодарность не только на словах. \n\nЯ имею в виду сундучок с ценностями, конечно.', '', '', '', '', '', '', 39653),
(62639, 'ruRU', 'Лучшие из лучших', 'Воспользуйтесь системой поиска боев и победите 5 игроков. Все питомцы в вашей команде должны быть 25-го уровня.', 'Нынешнее расположение звезд на небе очень странно. Самые крохотные создания вдруг непонятно как обрели невероятные таланты. Никто из наших мудрецов не может объяснить этот феномен, но умелые дрессировщики совершенно точно смогут извлечь большую выгоду из этой ситуации – особенно померившись силами со своими товарищами по ремеслу.', '', '', '', '', '', '', 39653),
(62563, 'ruRU', 'Снова в своем теле!', 'Победите Громанд Потрошительницу.', 'Громанд никак не угомонится!\n\nМы побеждали ее уже несколько раз, но ее тело всякий раз вытаскивают, сшивают и посылают обратно!\n\nОна думает, что на этот раз справится с нами... пусть поймет, как ошибалась.', '', 'Кадавр, которого создали очень давно, и с тех пор множество раз побеждали и перекраивали.', 'Громанд Потрошительница', '', '', '', 39653),
(62435, 'ruRU', 'Дух оленя', 'Отнесите дух оленя леди Муун в Сердце леса.', '<Дух оленя благороден и могуч. Теперь вы можете обращаться в оленя.>', '', '', '', '', '', 'Отнесите дух оленя леди Муун в Сердце леса.', 39653),
(62432, 'ruRU', 'Дух совокошки', 'Отнесите дух совокошки леди Муун в Сердце леса.', '<Дух совокошки проказлив и любопытен. Этот зверь с радостью бросается навстречу новым опасностям. Несоответствие, казалось бы, частей тела не мешает ему двигаться легко и слаженно. Теперь вы можете обращаться в совокошку.>', '', '', '', '', '', 'Отнесите дух совокошки леди Муун в Сердце леса.', 39653),
(62427, 'ruRU', 'Дух гиппогрифа', 'Отнесите дух гиппогрифа леди Муун в Сердце леса.', '<Дух гиппогрифа умен и отважен. Теперь вы можете обращаться в гиппогрифа.>', '', '', '', '', '', 'Отнесите дух гиппогрифа леди Муун в Сердце леса.', 39653),
(62195, 'ruRU', 'Последнее слово', 'Помогите Сабрине освободить инквизитора Темниону.', 'Инквизитор Темниона стремилась овладеть тайной магией, пока Денатрий не посадил ее под замок.\n\nЯ слышала, она готова передать свои знания любому, кто освободит ее из тюрьмы.\n\nЯ хочу научиться всему, что она знает. Идем и освободим Темниону!', '', '', '', '', '', '', 39653),
(62162, 'ruRU', 'Послание вершительницы правосудия', 'Явитесь к вершительнице правосудия Мариэль Чистосердечной на ристалище Серебряного турнира у Ледяной Короны.', 'Вершительница правосудия Мариэль Чистосердечная просит тебя незамедлительно оказать ей поддержку, $n.\n\nХолодные ветра Ледяной Короны ждут твоего возвращения.', '', '', '', '', '', '', 39653),
(61737, 'ruRU', 'Похищения', 'Поговорите с Назгримом о похищениях.', 'Мне нужно многое тебе рассказать, $n.\n\nПлеть вернулась. Когда Шлем Господства был расколот, это зло вышло из-под контроля. Им больше никто не управляет.\n\nЧто еще хуже, Сильвана Ветрокрылая отправила свои силы в самое сердце наших земель, чтобы похитить тех, кто пытался нарушить ее планы в ходе войны.\n\nПоговори с Назгримом. Он расскажет тебе остальное.', '', '', '', '', '', 'Расспросите Назгрима о похищениях.', 39653),
(61736, 'ruRU', 'Похищения', 'Поговорите с Салли Вайтмейн о похищениях.', 'Мне нужно многое тебе рассказать, $n.\n\nПлеть вернулась. Когда Шлем Господства был расколот, это зло вышло из-под контроля. Им больше никто не управляет.\n\nЧто еще хуже, Сильвана Ветрокрылая отправила свои силы в самое сердце наших земель, чтобы похитить тех, кто пытался нарушить ее планы в ходе войны.\n\nПоговори с Вайтмейн. Она расскажет тебе остальное.', '', '', '', '', '', 'Расспросите Салли Вайтмейн о похищениях.', 39653),
(61631, 'ruRU', 'Угроза друстов', '', '', '', '', '', '', '', '', 39653),
