(61603, 'ruRU', 'Снятие шкур: толстая шкура горма', '', '', '', '', '', '', '', '', 39653),
(61595, 'ruRU', 'Алхимия: зелье спокойной спячки', '', '', '', '', '', '', '', '', 39653),
(61467, 'ruRU', 'Горное дело: скопление светящегося соленита', '', '', '', '', '', '', '', '', 39653),
(61449, 'ruRU', 'Кожевничество: сбруя из стальной шкуры', '', '', '', '', '', '', '', '', 39653),
(61433, 'ruRU', 'Большой легочник', '', '', '', '', '', '', '', '', 39653),
(60759, 'ruRU', 'Вторжение проклятых', 'Убейте $1oa |4сектанта:сектантов:сектантов; и $2oa |4кровожадного вурдалака:кровожадных вурдалаков:кровожадных вурдалаков; на Перекрестке.', 'Отчет должен быть доставлен офицеру Троггу как можно скорее, но мы не можем оставить Перекресток без защиты.\n\nЯ прошу тебя перед отправлением помочь нам в бою с Плетью. Проредив их ряды, ты дашь нам долгожданную передышку.', '', '', '', '', '', '', 39653),
(60669, 'ruRU', 'Новая причина для беспокойства', 'Поговорите с Лор\'темаром Тероном на верхнем этаже крепости Громмаш в Оргриммаре.', 'Орду осадили, $p.\n\nНежить Плети собирается в огромные полчища, ничего подобного мы не видели с тех пор, как Артас Менетил сел на Ледяной Трон.\n\nИ в довершение всего... произошло нечто ужасное.\n\nДержи все, что я расскажу, в строжайшей тайне. Скоро об этом узнают все, но сначала мне нужно поговорить с тобой лично.\n\nПозволь объяснить.', '', '', '', '', '', '', 39653),
(60658, 'ruRU', 'Ненасытный аппетит', '', '', '', '', '', '', '', '', 39653),
(60564, 'ruRU', 'Не выживет ни один', '', '', '', '', '', '', '', '', 39653),
(60534, 'ruRU', 'Нелояльные обитатели', '', '', '', '', '', '', '', '', 39653),
(60482, 'ruRU', 'Взгляни моими глазами', 'Найдите $1oa ед. оружия;.', 'С тех пор, как наш дом был разрушен, местные пауки становятся все агрессивнее. Они расширяют свои территории и нападают на немногих выживших, которые еще здесь остаются. \n\nНеподалеку есть оружие, которым мы сможем себя защитить. К сожалению, оно спрятано в Слепой цитадели и укрыто паутиной пауков-прядильщиков, облюбовавших это место.\n\nОтправляйся туда, используй мой дар слепого видения и забери как можно больше оружия.', '', '', '', '', '', '', 39653),
(59839, 'ruRU', 'Внимание: это только тест!', 'Успешно выполните испытания \"тайного оружия\" Физзикса Рвизасова на заставе Вестника Смерти.', 'Там, где другие видят проблему, я вижу новую возможность. Вся эта неурядица с Плетью требует оригинального подхода!\n\nПолюбуйся: это мое \"тайное оружие\"!\n\nУправлять им можно только с помощью моего контролирующего устройства тонкой работы, или, сокращенно, КУТР!\n\nГм... Кажется, над названием нужно еще подумать.\n\nТы $gпервый:первая; его $gувидел:увидела;, а значит, это ты проведешь его первое испытание. Но не беспокойся: я уверен, что оно практически безопасно.\n\nУдачи!', '', '', '', '', '', '', 39653),
(59783, 'ruRU', 'Культисты-пленители', 'Добудьте ключ дознавателя, убив дознавателя Грелля. Спасите $2oa |4пленного претендента:пленных претендентов:пленных претендентов; в Дозоре Вестника смерти.', 'Эти проклятые сектанты все никак не успокоятся!\n\nОни застали нас врасплох и уволокли пару наших рыцарей к себе в лагерь.\n\nЛишь Свету известно, как над ними сейчас издеваются...\n\nНо говорят, что ты своих в беде не бросаешь. Наших сил и так едва хватает... и если ты освободишь пленных, мы будем перед тобой в неоплатном долгу.\n\nЛагерь сектантов ты найдешь в горах.', '', '', '', '', '', '', 39653),
(59600, 'ruRU', 'Неприятности из-за гнилошипов', '', '', '', '', '', '', '', '', 39653),
(59598, 'ruRU', 'Бальзам на душу', 'Поговорите с Мериком.', 'Одна душа хорошо, а две – еще лучше! Вместе мы можем добиться большего, нежели поодиночке.\n\nОднако нам не придется справляться со всеми угрозами вдвоем. Найдутся многие другие, кто готов помочь нам в предстоящих сражениях.\n\nПоговори с Мериком, чтобы все разузнать. Не стесняйся... я вас познакомлю!', '', '', '', '', '', '', 39653),
(59259, 'ruRU', 'Вечный мучитель', '', '', '', '', '', '', '', '', 39653),
(58207, 'ruRU', 'Избавление от вредителей', '', '', '', '', '', '', '', '', 39653),
(57537, 'ruRU', 'Заметание следов', 'Отправляйтесь с Дрекой в дом Избранных.', 'Я принадлежу к дому Избранных. На юге у нас есть крепость, там должно быть безопасно.\n\nОстаток пути мы пролетим. Когда будешь $gготов:готова; отправляться, подойди к моему костекрылу.', '', '', '', '', '', '', 39653),
(57513, 'ruRU', 'Враг моего врага', 'Покиньте Театр Боли.', 'Не сомневаюсь, что у тебя море вопросов. Знай же, что у нас с тобой здесь общий враг.\n\nА теперь нам пора идти. Поговорим, когда найдем безопасное место.', '', '', '', '', '', '', 39653),
(56470, 'ruRU', 'Бросить кость собаке', 'Добудьте $1oa |4кусок:куска:кусков; мяса мозгопарышей.', 'Луисон одолжил мне Собачью Кость, чтобы сподручнее расправляться с мозгопарышами, но у меня тут и без того дел по горло. Не подсобишь?\n\nСобачья Кость любит рвать на части небольших кусак; при этом он очень шумит, и крупные мозгопарыши бросаются наутек. Вот тут-то ты и пригодишься!\n\nПодмани Собачью Кость поближе к кусакам этой костью. И не забудь потом добыть мясо мозгопарышей! Ты все это проделываешь именно ради него.', '', '', '', '', '', '', 39653),
(56364, 'ruRU', 'Ржавоболтский запрос: бешеная клыкозубая сельдь', 'Принесите $1oa |4образец:образца:образцов; руды штормового серебра Скеггиту.', '', '', '', '', '', '', '', 39653),
(56363, 'ruRU', 'Ржавоболтский запрос: бешеная клыкозубая сельдь', 'Принесите $1oa |4образец:образца:образцов; руды штормового серебра Джиле Закоротке.', '', '', '', '', '', '', '', 39653),
