(43883, 'ruRU', 'Копание в книгах', 'Разместите заказ на исследование.', 'У тебя грозное и древнее оружие. Но мы так мало о нем знаем. Чтобы полностью раскрыть потенциал этого артефакта, нужно тщательнее изучить его. Я могу тебе в этом посодействовать.\n\nНо в одиночку я не справлюсь: потребуется много времени и сил, чтобы изучить все эти исторические документы, перевести и извлечь из них что-то полезное.\n\nНужно выделить часть ресурсов ордена на это исследование. Но усилия окупятся с лихвой.', '', '', '', '', '', '', 39653),
(43344, 'ruRU', 'ОЧЕНЬ ОПАСНА: Аода Сухой Лепесток', '', '', '', '', '', '', '', '', 39653),
