(39692, 'ruRU', 'Призыв к оружию', 'Поговорите с вождем.', 'Добро пожаловать в Оргриммар, оплот Орды.$B$BВойди в крепость Громмаш и представься вождю Вол\'джину.$B$BОн ждет тебя.', '', '', '', '', '', '', 39653),
(30122, 'ruRU', 'Филигранная серебряная фляга', 'Наполните флягу мощной алхимической смесью.', 'Вам удалось найти красивую серебряную флягу, украшенную узорной филигранью. Если соединить нужные ингредиенты и познания в алхимии, она может стать по-настоящему магической.', '', '', '', '', '', '', 39653),
(14160, 'ruRU', 'Список заслуг', 'Доставьте Список заслуг Тимоти Джонсу в Даларан.', 'В этом свитке перечислены многие великие достижения, полученные |3-4($n) в области ювелирного искусства.$b$bОтнесите его Тимоти Джонсу и получите причитающуюся награду.', '', '', '', '', '', '', 39653),
(11194, 'ruRU', '[DEPRECATED]Is it Real?', 'Поговорите с Натом Пэглом в лагере Ната, что в Пылевых топях.', 'Да, вы с Бабс наверняка вволю посмеялись над нелепыми описаниями да картинками в этой книжонке. Однако я бы на вашем месте задумался: вдруг в этих легендах есть доля правды?$B$BКое-где до сих пор можно услышать рассказы моряков о Тетуре, морской твари, которая, судя по книжке, водится где-то здесь! Конечно, если хочешь знать наверняка, спроси старину Ната Пэгла.$B$BОн устроил себе небольшой лагерь на островке в Заливе Яростных Волн, что к юго-западу, за Пылевой бухтой.', '', '', '', '', '', '', 39653),
(9522, 'ruRU', 'Больше никогда!', 'Добудьте пламенеющее лезвие Горганнона и желчное копье Ищейки.', '$n, на твои плечи ложится обязанность сорвать нападение Пылающего Легиона! Ты $Gдолжен:должна; уничтожить их предводителей. Остальные демоны, по большей части – безмозглые твари. $B$BГорганнона ты найдешь в Каньоне Гибели демона к югу за Холмом Демонического Огня, близ сломанного, парящего копья Маннорота.$B$BДиатор Ищейка засел где-то в логове в холме над Грядой Гибели Демона. Чтобы найти эту гряду, отыщи уступ, по которому можно подняться из Каньона Гибели демона близ памятника Грому Адскому Крику.$B$BПринеси мне их оружие.', '', '', '', '', '', '', 39653);
